(28, 'Downlaods', 'Downlaods ', '<p>\r\n	Please choose the program for your computer or device Windows version Android Apple and iOS</p>\r\n<h2>\r\n	<strong><a download="" href="cybtellwin.msi"> Download Windows 32bit</a></strong></h2>\r\n<p>\r\n	&nbsp;</p>\r\n', 'Penguins.jpg', 2),
(29, 'Terms & Conditions', 'Terms & Conditions', '<p>\r\n	<span style="font-size:24px;"><strong>Terms &amp; Conditions &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</strong></span></p>\r\n<p>\r\n	&nbsp;</p>\r\n<ul>\r\n	<li>\r\n		<span style="background-color:#ffff00;">No profanity </span></li>\r\n	<li>\r\n		<span style="background-color:#ffff00;">No spam, </span></li>\r\n	<li>\r\n		<span style="background-color:#ffff00;">no bullying, </span></li>\r\n	<li>\r\n		<span style="background-color:#ffff00;">no harassment, </span></li>\r\n	<li>\r\n		<span style="background-color:#ffff00;">no hate and no violence incitement.&nbsp;</span></li>\r\n	<li>\r\n		<em><strong>You can choose the screen ID of your choice but you must tell correct information in your profile. You can hide any information from public viewing if you like. </strong></em></li>\r\n	<li>\r\n		Your freedom of speech must follow the laws of the United States of America</li>\r\n</ul>\r\n', 'NA', 3),
(30, 'Help', 'Help ', '<ul>\r\n	<li>\r\n		<span style="font-family:times new roman,times,serif;"><span style="font-size: 20px;"><strong>Profile Information:</strong></span> Cybchat is being used equally for personal and business needs. Cybchat allows you to choose a public ID of your choice. You can post your picture or an image BUT you can not post an image of another person.</span></li>\r\n	<li>\r\n		<span style="font-family:times new roman,times,serif;">Please choose your regions/country and City and State. Correct selection of country and region will help you with auto adjustment of time and date.</span></li>\r\n	<li>\r\n		<span style="font-family:times new roman,times,serif;">Cybchat uses following formats for Date: MM/DD/YYYY 12/31/2014&nbsp;</span></li>\r\n	<li>\r\n		<span style="font-family:times new roman,times,serif;">You have the option to keep your information private. Please go to settings and set your privacy settings as you desire.&nbsp;</span></li>\r\n</ul>\r\n<p>\r\n	&nbsp;</p>\r\n', 'NA', 4),
(31, 'Business', 'Business Members', '<p>\r\n	<span style="color:#0000ff;"><strong>Do you own a business or represent a business?</strong></span></p>\r\n<p>\r\n	<span style="color:#0000ff;"><strong>We love to see your business grow. </strong></span></p>\r\n<p>\r\n	<span style="color:#0000ff;"><strong>Please tell us about you?&nbsp;</strong></span></p>\r\n', 'NA', 5),
(33, 'Network News', 'News', '                <p>\r\n	<u><strong>This is news of the day</strong></u></p>\r\n            ', 'NA', 6),
(34, 'Privacy Policy', 'Privacy Policy', '<p style="box-sizing: border-box; margin: 0px 0px 10px; text-align: justify; padding-bottom: 8px; padding-right: 10px; color: rgb(51, 51, 51); font-family: verdana; font-size: 14px; line-height: 20px; background-color: rgb(245, 245, 245);">\r\n	<span style="box-sizing: border-box; font-weight: 700;"><a href="https://pronoor.com/" style="box-sizing: border-box; color: rgb(102, 102, 102); text-decoration: none; background-color: transparent;">https://Cybchat.com</a>&nbsp;Privacy Policy</span><br style="box-sizing: border-box;" />\r\n	This privacy policy has been compiled to better serve those who are concerned with how their &quot;Personally identifiable information&quot; (PII) is being used online. PII, as used in US privacy law and information security, is information that can be used on its own or with other information to identify, contact, or locate a single person, or to identify an individual in context. Please read our privacy policy carefully to get a clear understanding of how we collect, use, protect or otherwise handle your Personally Identifiable Information in accordance with our website.&nbsp;<br style="box-sizing: border-box;" />\r\n	<br style="box-sizing: border-box;" />\r\n	<span style="box-sizing: border-box; font-weight: 700;">What personal information do we collect from the people that visit our blog, website or app?</span></p>\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; text-align: justify; padding-bottom: 8px; padding-right: 10px; color: rgb(51, 51, 51); font-family: verdana; font-size: 14px; line-height: 20px; background-color: rgb(245, 245, 245);">\r\n	When ordering or registering on our site, as appropriate, you may be asked to enter your name, email address, mailing address, phone number, credit card information or other details to help you with your experience.</p>\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; text-align: justify; padding-bottom: 8px; padding-right: 10px; color: rgb(51, 51, 51); font-family: verdana; font-size: 14px; line-height: 20px; background-color: rgb(245, 245, 245);">\r\n	<span style="font-weight: 700;">When do we collect information?</span></p>\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; text-align: justify; padding-bottom: 8px; padding-right: 10px; color: rgb(51, 51, 51); font-family: verdana; font-size: 14px; line-height: 20px; background-color: rgb(245, 245, 245);">\r\n	We collect information from you when you register on our site, place an order, fill out a form or enter information on our site.</p>\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; text-align: justify; padding-bottom: 8px; padding-right: 10px; color: rgb(51, 51, 51); font-family: verdana; font-size: 14px; line-height: 20px; background-color: rgb(245, 245, 245);">\r\n	<span style="box-sizing: border-box; font-weight: 700;">How do we use your information?</span></p>\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; text-align: justify; padding-bottom: 8px; padding-right: 10px; color: rgb(51, 51, 51); font-family: verdana; font-size: 14px; line-height: 20px; background-color: rgb(245, 245, 245);">\r\n	We may use the information we collect from you when you register, make a purchase, sign up for our newsletter, respond to a survey or marketing communication, surf the website, or use certain other site features in the following ways:</p>\r\n<ul style="box-sizing: border-box; margin-top: 0px; margin-bottom: 10px; color: rgb(51, 51, 51); font-family: verdana; font-size: 14px; line-height: 20px; background-color: rgb(245, 245, 245);">\r\n	<li style="box-sizing: border-box;">\r\n		To allow us to better service you in responding to your customer service requests.</li>\r\n	<li style="box-sizing: border-box;">\r\n		To quickly process your transactions.</li>\r\n	<li style="box-sizing: border-box;">\r\n		To send periodic emails regarding your order or other products and services.</li>\r\n</ul>\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; text-align: justify; padding-bottom: 8px; padding-right: 10px; color: rgb(51, 51, 51); font-family: verdana; font-size: 14px; line-height: 20px; background-color: rgb(245, 245, 245);">\r\n	<span style="font-weight: 700;">How do we protect visitor information?</span></p>\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; text-align: justify; padding-bottom: 8px; padding-right: 10px; color: rgb(51, 51, 51); font-family: verdana; font-size: 14px; line-height: 20px; background-color: rgb(245, 245, 245);">\r\n	Our website is scanned on a regular basis for security holes and known vulnerabilities in order to make your visit to our site as safe as possible.</p>\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; text-align: justify; padding-bottom: 8px; padding-right: 10px; color: rgb(51, 51, 51); font-family: verdana; font-size: 14px; line-height: 20px; background-color: rgb(245, 245, 245);">\r\n	We use regular Malware Scanning.</p>\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; text-align: justify; padding-bottom: 8px; padding-right: 10px; color: rgb(51, 51, 51); font-family: verdana; font-size: 14px; line-height: 20px; background-color: rgb(245, 245, 245);">\r\n	Your personal information is contained behind secured networks and is only accessible by a limited number of persons who have special access rights to such systems, and are required to keep the information confidential. In addition, all sensitive/credit information you supply is encrypted via Secure Socket Layer (SSL) technology.</p>\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; text-align: justify; padding-bottom: 8px; padding-right: 10px; color: rgb(51, 51, 51); font-family: verdana; font-size: 14px; line-height: 20px; background-color: rgb(245, 245, 245);">\r\n	We implement a variety of security measures when a user places an order enters, submits, or accesses their information to maintain the safety of your personal information.</p>\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; text-align: justify; padding-bottom: 8px; padding-right: 10px; color: rgb(51, 51, 51); font-family: verdana; font-size: 14px; line-height: 20px; background-color: rgb(245, 245, 245);">\r\n	For your convenience we may store your credit card information longer than 30 days in order to expedite future orders, and to automate the billing process.</p>\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; text-align: justify; padding-bottom: 8px; padding-right: 10px; color: rgb(51, 51, 51); font-family: verdana; font-size: 14px; line-height: 20px; background-color: rgb(245, 245, 245);">\r\n	<span style="font-weight: 700;">Do we use cookies?</span></p>\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; text-align: justify; padding-bottom: 8px; padding-right: 10px; color: rgb(51, 51, 51); font-family: verdana; font-size: 14px; line-height: 20px; background-color: rgb(245, 245, 245);">\r\n	We do not use cookies for tracking purposes</p>\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; text-align: justify; padding-bottom: 8px; padding-right: 10px; color: rgb(51, 51, 51); font-family: verdana; font-size: 14px; line-height: 20px; background-color: rgb(245, 245, 245);">\r\n	<br style="box-sizing: border-box;" />\r\n	You can choose to have your computer warn you each time a cookie is being sent, or you can choose to turn off all cookies. You do this through your browser (like Internet Explorer) settings. Each browser is a little different, so look at your browsers Help menu to learn the correct way to modify your cookies.</p>\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; text-align: justify; padding-bottom: 8px; padding-right: 10px; color: rgb(51, 51, 51); font-family: verdana; font-size: 14px; line-height: 20px; background-color: rgb(245, 245, 245);">\r\n	If you disable cookies off, some features will be disabled that make your site experience more efficient and some of our services will not function properly.</p>\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; text-align: justify; padding-bottom: 8px; padding-right: 10px; color: rgb(51, 51, 51); font-family: verdana; font-size: 14px; line-height: 20px; background-color: rgb(245, 245, 245);">\r\n	However, you can still place orders .</p>\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; text-align: justify; padding-bottom: 8px; padding-right: 10px; color: rgb(51, 51, 51); font-family: verdana; font-size: 14px; line-height: 20px; background-color: rgb(245, 245, 245);">\r\n	<span style="font-weight: 700;">Third Party Disclosure</span></p>\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; text-align: justify; padding-bottom: 8px; padding-right: 10px; color: rgb(51, 51, 51); font-family: verdana; font-size: 14px; line-height: 20px; background-color: rgb(245, 245, 245);">\r\n	We do not sell, trade, or otherwise transfer to outside parties your personally identifiable information.</p>\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; text-align: justify; padding-bottom: 8px; padding-right: 10px; color: rgb(51, 51, 51); font-family: verdana; font-size: 14px; line-height: 20px; background-color: rgb(245, 245, 245);">\r\n	<span style="font-weight: 700;">Third party links</span></p>\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; text-align: justify; padding-bottom: 8px; padding-right: 10px; color: rgb(51, 51, 51); font-family: verdana; font-size: 14px; line-height: 20px; background-color: rgb(245, 245, 245);">\r\n	We do not include or offer third party products or services on our website.</p>\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; text-align: justify; padding-bottom: 8px; padding-right: 10px; color: rgb(51, 51, 51); font-family: verdana; font-size: 14px; line-height: 20px; background-color: rgb(245, 245, 245);">\r\n	<span style="box-sizing: border-box; font-weight: 700;">Google</span></p>\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; text-align: justify; padding-bottom: 8px; padding-right: 10px; color: rgb(51, 51, 51); font-family: verdana; font-size: 14px; line-height: 20px; background-color: rgb(245, 245, 245);">\r\n	Google advertising requirements can be summed up by Google Advertising Principles. They are put in place to provide a positive experience for users.&nbsp;<a href="https://support.google.com/adwordspolicy/answer/1316548?hl=en" style="box-sizing: border-box; color: rgb(102, 102, 102); text-decoration: none; background-color: transparent;" target="_blank">https://support.google.com/<wbr style="box-sizing: border-box;">adwordspolicy/answer/1316548?<wbr style="box-sizing: border-box;">hl=en</wbr></wbr></a></p>\r\n<p>\r\n	<wbr style="box-sizing: border-box;"><wbr style="box-sizing: border-box;">\r\n	<p>\r\n		<wbr style="box-sizing: border-box;"><wbr style="box-sizing: border-box;"></wbr></wbr></p>\r\n	<wbr style="box-sizing: border-box;"><wbr style="box-sizing: border-box;">\r\n	<p>\r\n		<wbr style="box-sizing: border-box;"><wbr style="box-sizing: border-box;"> </wbr></wbr></p>\r\n	<wbr style="box-sizing: border-box;"><wbr style="box-sizing: border-box;"><wbr style="box-sizing: border-box;"><wbr style="box-sizing: border-box;">\r\n	<p style="box-sizing: border-box; margin: 0px 0px 10px; text-align: justify; padding-bottom: 8px; padding-right: 10px; color: rgb(51, 51, 51); font-family: verdana; font-size: 14px; line-height: 20px; background-color: rgb(245, 245, 245);">\r\n		We have not enabled Google AdSense on our site and we may never do so in the future.</p>\r\n	<p style="box-sizing: border-box; margin: 0px 0px 10px; text-align: justify; padding-bottom: 8px; padding-right: 10px; color: rgb(51, 51, 51); font-family: verdana; font-size: 14px; line-height: 20px; background-color: rgb(245, 245, 245);">\r\n		<span style="box-sizing: border-box; font-weight: 700;">California Online Privacy Protection Act</span></p>\r\n	<p style="box-sizing: border-box; margin: 0px 0px 10px; text-align: justify; padding-bottom: 8px; padding-right: 10px; color: rgb(51, 51, 51); font-family: verdana; font-size: 14px; line-height: 20px; background-color: rgb(245, 245, 245);">\r\n		CalOPPA is the first state law in the nation to require commercial websites and online services to post a privacy policy. The law&#39;s reach stretches well beyond California to require a person or company in the United States (and conceivably the world) that operates websites collecting personally identifiable information from California consumers to post a conspicuous privacy policy on its website stating exactly the information being collected and those individuals with whom it is being shared, and to comply with this policy. - See more at: http://consumercal.org/california-online-privacy-protection-act-caloppa/#sthash.0FdRbT51.dpuf</p>\r\n	<p style="box-sizing: border-box; margin: 0px 0px 10px; text-align: justify; padding-bottom: 8px; padding-right: 10px; color: rgb(51, 51, 51); font-family: verdana; font-size: 14px; line-height: 20px; background-color: rgb(245, 245, 245);">\r\n		<span style="box-sizing: border-box; font-weight: 700;">According to CalOPPA we agree to the following:</span></p>\r\n	<p style="box-sizing: border-box; margin: 0px 0px 10px; text-align: justify; padding-bottom: 8px; padding-right: 10px; color: rgb(51, 51, 51); font-family: verdana; font-size: 14px; line-height: 20px; background-color: rgb(245, 245, 245);">\r\n		Users can visit our site anonymously</p>\r\n	<p style="box-sizing: border-box; margin: 0px 0px 10px; text-align: justify; padding-bottom: 8px; padding-right: 10px; color: rgb(51, 51, 51); font-family: verdana; font-size: 14px; line-height: 20px; background-color: rgb(245, 245, 245);">\r\n		Once this privacy policy is created, we will add a link to it on our home page, or as a minimum on the first significant page after entering our website.</p>\r\n	<p style="box-sizing: border-box; margin: 0px 0px 10px; text-align: justify; padding-bottom: 8px; padding-right: 10px; color: rgb(51, 51, 51); font-family: verdana; font-size: 14px; line-height: 20px; background-color: rgb(245, 245, 245);">\r\n		Our Privacy Policy link includes the word &#39;Privacy&#39;, and can be easily be found on the page specified above.</p>\r\n	<p style="box-sizing: border-box; margin: 0px 0px 10px; text-align: justify; padding-bottom: 8px; padding-right: 10px; color: rgb(51, 51, 51); font-family: verdana; font-size: 14px; line-height: 20px; background-color: rgb(245, 245, 245);">\r\n		Users will be notified of any privacy policy changes:</p>\r\n	<ul style="box-sizing: border-box; margin-top: 0px; margin-bottom: 10px; color: rgb(51, 51, 51); font-family: verdana; font-size: 14px; line-height: 20px; background-color: rgb(245, 245, 245);">\r\n		<li style="box-sizing: border-box;">\r\n			On our Privacy Policy Page</li>\r\n	</ul>\r\n	<p style="box-sizing: border-box; margin: 0px 0px 10px; text-align: justify; padding-bottom: 8px; padding-right: 10px; color: rgb(51, 51, 51); font-family: verdana; font-size: 14px; line-height: 20px; background-color: rgb(245, 245, 245);">\r\n		Users are able to change their personal information:</p>\r\n	<ul style="box-sizing: border-box; margin-top: 0px; margin-bottom: 10px; color: rgb(51, 51, 51); font-family: verdana; font-size: 14px; line-height: 20px; background-color: rgb(245, 245, 245);">\r\n		<li style="box-sizing: border-box;">\r\n			By emailing us</li>\r\n		<li style="box-sizing: border-box;">\r\n			By logging in to their account</li>\r\n		<li style="box-sizing: border-box;">\r\n			By chatting with us or sending us a ticket</li>\r\n	</ul>\r\n	<p style="box-sizing: border-box; margin: 0px 0px 10px; text-align: justify; padding-bottom: 8px; padding-right: 10px; color: rgb(51, 51, 51); font-family: verdana; font-size: 14px; line-height: 20px; background-color: rgb(245, 245, 245);">\r\n		<span style="box-sizing: border-box; font-weight: 700;">How does our site handle do not track signals?</span></p>\r\n	<p style="box-sizing: border-box; margin: 0px 0px 10px; text-align: justify; padding-bottom: 8px; padding-right: 10px; color: rgb(51, 51, 51); font-family: verdana; font-size: 14px; line-height: 20px; background-color: rgb(245, 245, 245);">\r\n		We honor do not track signals and do not track, plant cookies, or use advertising when a Do Not Track (DNT) browser mechanism is in place.</p>\r\n	<p style="box-sizing: border-box; margin: 0px 0px 10px; text-align: justify; padding-bottom: 8px; padding-right: 10px; color: rgb(51, 51, 51); font-family: verdana; font-size: 14px; line-height: 20px; background-color: rgb(245, 245, 245);">\r\n		<span style="box-sizing: border-box; font-weight: 700;">Does our site allow third party behavioral tracking?</span></p>\r\n	<p style="box-sizing: border-box; margin: 0px 0px 10px; text-align: justify; padding-bottom: 8px; padding-right: 10px; color: rgb(51, 51, 51); font-family: verdana; font-size: 14px; line-height: 20px; background-color: rgb(245, 245, 245);">\r\n		It&#39;s also important to note that we do not allow third party behavioral tracking</p>\r\n	<p style="box-sizing: border-box; margin: 0px 0px 10px; text-align: justify; padding-bottom: 8px; padding-right: 10px; color: rgb(51, 51, 51); font-family: verdana; font-size: 14px; line-height: 20px; background-color: rgb(245, 245, 245);">\r\n		<span style="box-sizing: border-box; font-weight: 700;">COPPA (Children Online Privacy Protection Act)</span></p>\r\n	<p style="box-sizing: border-box; margin: 0px 0px 10px; text-align: justify; padding-bottom: 8px; padding-right: 10px; color: rgb(51, 51, 51); font-family: verdana; font-size: 14px; line-height: 20px; background-color: rgb(245, 245, 245);">\r\n		When it comes to the collection of personal information from children under 13, the Children&#39;s Online Privacy Protection Act (COPPA) puts parents in control. The Federal Trade Commission, the nation&#39;s consumer protection agency, enforces the COPPA Rule, which spells out what operators of websites and online services must do to protect children&#39;s privacy and safety online.</p>\r\n	<p style="box-sizing: border-box; margin: 0px 0px 10px; text-align: justify; padding-bottom: 8px; padding-right: 10px; color: rgb(51, 51, 51); font-family: verdana; font-size: 14px; line-height: 20px; background-color: rgb(245, 245, 245);">\r\n		We do not specifically market to children under 13.</p>\r\n	<p style="box-sizing: border-box; margin: 0px 0px 10px; text-align: justify; padding-bottom: 8px; padding-right: 10px; color: rgb(51, 51, 51); font-family: verdana; font-size: 14px; line-height: 20px; background-color: rgb(245, 245, 245);">\r\n		<span style="box-sizing: border-box; font-weight: 700;">Fair Information Practices</span></p>\r\n	<p style="box-sizing: border-box; margin: 0px 0px 10px; text-align: justify; padding-bottom: 8px; padding-right: 10px; color: rgb(51, 51, 51); font-family: verdana; font-size: 14px; line-height: 20px; background-color: rgb(245, 245, 245);">\r\n		The Fair Information Practices Principles form the backbone of privacy law in the United States and the concepts they include have played a significant role in the development of data protection laws around the globe. Understanding the Fair Information Practice Principles and how they should be implemented is critical to comply with the various privacy laws that protect personal information.</p>\r\n	<p style="box-sizing: border-box; margin: 0px 0px 10px; text-align: justify; padding-bottom: 8px; padding-right: 10px; color: rgb(51, 51, 51); font-family: verdana; font-size: 14px; line-height: 20px; background-color: rgb(245, 245, 245);">\r\n		<span style="box-sizing: border-box; font-weight: 700;">In order to be in line with Fair Information Practices we will take the following responsive action, should a data breach occur:</span></p>\r\n	<p style="box-sizing: border-box; margin: 0px 0px 10px; text-align: justify; padding-bottom: 8px; padding-right: 10px; color: rgb(51, 51, 51); font-family: verdana; font-size: 14px; line-height: 20px; background-color: rgb(245, 245, 245);">\r\n		We will notify the users via email</p>\r\n	<ul style="box-sizing: border-box; margin-top: 0px; margin-bottom: 10px; color: rgb(51, 51, 51); font-family: verdana; font-size: 14px; line-height: 20px; background-color: rgb(245, 245, 245);">\r\n		<li style="box-sizing: border-box;">\r\n			Within 7 business days</li>\r\n	</ul>\r\n	<p style="box-sizing: border-box; margin: 0px 0px 10px; text-align: justify; padding-bottom: 8px; padding-right: 10px; color: rgb(51, 51, 51); font-family: verdana; font-size: 14px; line-height: 20px; background-color: rgb(245, 245, 245);">\r\n		We will notify the users via in site notification</p>\r\n	<ul style="box-sizing: border-box; margin-top: 0px; margin-bottom: 10px; color: rgb(51, 51, 51); font-family: verdana; font-size: 14px; line-height: 20px; background-color: rgb(245, 245, 245);">\r\n		<li style="box-sizing: border-box;">\r\n			Within 7 business days</li>\r\n	</ul>\r\n	<p style="box-sizing: border-box; margin: 0px 0px 10px; text-align: justify; padding-bottom: 8px; padding-right: 10px; color: rgb(51, 51, 51); font-family: verdana; font-size: 14px; line-height: 20px; background-color: rgb(245, 245, 245);">\r\n		We also agree to the individual redress principle, which requires that individuals have a right to pursue legally enforceable rights against data collectors and processors who fail to adhere to the law. This principle requires not only that individuals have enforceable rights against data users, but also that individuals have recourse to courts or a government agency to investigate and/or prosecute non-compliance by data processors.</p>\r\n	<p style="box-sizing: border-box; margin: 0px 0px 10px; text-align: justify; padding-bottom: 8px; padding-right: 10px; color: rgb(51, 51, 51); font-family: verdana; font-size: 14px; line-height: 20px; background-color: rgb(245, 245, 245);">\r\n		<span style="box-sizing: border-box; font-weight: 700;">CAN SPAM Act</span></p>\r\n	<p style="box-sizing: border-box; margin: 0px 0px 10px; text-align: justify; padding-bottom: 8px; padding-right: 10px; color: rgb(51, 51, 51); font-family: verdana; font-size: 14px; line-height: 20px; background-color: rgb(245, 245, 245);">\r\n		The CAN-SPAM Act is a law that sets the rules for commercial email, establishes requirements for commercial messages, gives recipients the right to have emails stopped from being sent to them, and spells out tough penalties for violations.</p>\r\n	<p style="box-sizing: border-box; margin: 0px 0px 10px; text-align: justify; padding-bottom: 8px; padding-right: 10px; color: rgb(51, 51, 51); font-family: verdana; font-size: 14px; line-height: 20px; background-color: rgb(245, 245, 245);">\r\n		<span style="box-sizing: border-box; font-weight: 700;">We collect your email address in order to:</span></p>\r\n	<ul style="box-sizing: border-box; margin-top: 0px; margin-bottom: 10px; color: rgb(51, 51, 51); font-family: verdana; font-size: 14px; line-height: 20px; background-color: rgb(245, 245, 245);">\r\n		<li style="box-sizing: border-box;">\r\n			Send information, respond to inquiries, and/or other requests or questions.</li>\r\n		<li style="box-sizing: border-box;">\r\n			Process orders and to send information and updates pertaining to orders</li>\r\n		<li style="box-sizing: border-box;">\r\n			We may also send you additional information related to your product and/or service.</li>\r\n		<li style="box-sizing: border-box;">\r\n			Market to our mailing list or continue to send emails to our clients after the original transaction has occurred</li>\r\n	</ul>\r\n	<p style="box-sizing: border-box; margin: 0px 0px 10px; text-align: justify; padding-bottom: 8px; padding-right: 10px; color: rgb(51, 51, 51); font-family: verdana; font-size: 14px; line-height: 20px; background-color: rgb(245, 245, 245);">\r\n		<span style="box-sizing: border-box; font-weight: 700;">To be in accordance with CANSPAM we agree to the following:</span></p>\r\n	<ul style="box-sizing: border-box; margin-top: 0px; margin-bottom: 10px; color: rgb(51, 51, 51); font-family: verdana; font-size: 14px; line-height: 20px; background-color: rgb(245, 245, 245);">\r\n		<li style="box-sizing: border-box;">\r\n			NOT use false, or misleading subjects or email addresses</li>\r\n		<li style="box-sizing: border-box;">\r\n			Identify the message as an advertisement in some reasonable way</li>\r\n		<li style="box-sizing: border-box;">\r\n			Include the physical address of our business or site headquarters</li>\r\n		<li style="box-sizing: border-box;">\r\n			Monitor third party email marketing services for compliance, if one is used.</li>\r\n		<li style="box-sizing: border-box;">\r\n			Honor opt-out/unsubscribe requests quickly</li>\r\n		<li style="box-sizing: border-box;">\r\n			Allow users to unsubscribe by using the link at the bottom of each email</li>\r\n	</ul>\r\n	<p style="box-sizing: border-box; margin: 0px 0px 10px; text-align: justify; padding-bottom: 8px; padding-right: 10px; color: rgb(51, 51, 51); font-family: verdana; font-size: 14px; line-height: 20px; background-color: rgb(245, 245, 245);">\r\n		<span style="box-sizing: border-box; font-weight: 700;">If at any time you would like to unsubscribe from receiving future emails, you can email us at</span></p>\r\n	<p style="box-sizing: border-box; margin: 0px 0px 10px; text-align: justify; padding-bottom: 8px; padding-right: 10px; color: rgb(51, 51, 51); font-family: verdana; font-size: 14px; line-height: 20px; background-color: rgb(245, 245, 245);">\r\n		Admin@pronoor.com and we will promptly remove you from ALL correspondence.</p>\r\n	<p style="box-sizing: border-box; margin: 0px 0px 10px; text-align: justify; padding-bottom: 8px; padding-right: 10px; color: rgb(51, 51, 51); font-family: verdana; font-size: 14px; line-height: 20px; background-color: rgb(245, 245, 245);">\r\n		<span style="box-sizing: border-box; font-weight: 700;">Contacting Us</span></p>\r\n	<p>\r\n		<wbr style="box-sizing: border-box;"><wbr style="box-sizing: border-box;"></wbr></wbr></p>\r\n	<wbr style="box-sizing: border-box;"><wbr style="box-sizing: border-box;"><wbr style="box-sizing: border-box;"><wbr style="box-sizing: border-box;"><wbr style="box-sizing: border-box;"><wbr style="box-sizing: border-box;">\r\n	<p style="box-sizing: border-box; margin: 0px 0px 10px; text-align: justify; padding-bottom: 8px; padding-right: 10px; color: rgb(51, 51, 51); font-family: verdana; font-size: 14px; line-height: 20px; background-color: rgb(245, 245, 245);">\r\n		If there are any questions regarding this privacy policy you may contact us using the information below.&nbsp;<br style="box-sizing: border-box;" />\r\n		<a href="https://pronoor.com/" style="box-sizing: border-box; color: rgb(102, 102, 102); text-decoration: none; background-color: transparent;">https://pronoor.com</a><br style="box-sizing: border-box;" />\r\n		4325 Downtowner Loop N<br style="box-sizing: border-box;" />\r\n		Mobile, Alabama 36609<br style="box-sizing: border-box;" />\r\n		USA<br style="box-sizing: border-box;" />\r\n		admin@pronoor.com<br style="box-sizing: border-box;" />\r\n		<br style="box-sizing: border-box;" />\r\n		Last Edited on 09/07/2015</p>\r\n	<p>\r\n		&nbsp;</p>\r\n	<p>\r\n		&nbsp;</p>\r\n	</wbr></wbr></wbr></wbr></wbr></wbr></wbr></wbr></wbr></wbr></wbr></wbr></wbr></wbr></p>\r\n', 'NA', 7),
