al; letter-spacing: normal; line-height: 20px; orphans: auto; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 1; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255);"></div><p><br></p><div class="note-control-sizing note-control-se" style="box-sizing: border-box; position: absolute; width: 7px; height: 7px; border: 1px solid black; right: -5px; bottom: -5px; cursor: se-resize; color: rgb(51, 51, 51); font-family: Helvetica, ''Helvetica Neue'', Arial, sans-serif; font-size: 14px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: 20px; orphans: auto; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 1; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: white;"></div><p><br class="Apple-interchange-newline"><img class="img-circle" data-filename="rezortify_rakshabandhan_occassion2.jpg" src="data:image/jpeg;base64," style="width: 100%;"><span style="font-weight: bold;"><br></span></p><p><span style="font-weight: bold;"><br></span></p><p><span style="font-weight: bold;"><br></span><br></p>', '', '0', 0, 'contact-us');
