(5, 'Terms & conditions', '<p><span style="font-family: Arial, Helvetica, sans;">Softral General Agreement</span></p>\r\n            \r\n    \r\n            \r\n    \r\n\r\n    <div class="mar">\r\n\r\n        <p><strong>In General </strong><br><br> Shaikh Corp. DBA <a href="https://www.pronoor.com">https://www.softral.com</a> owns and operate this Website as part of the Shaikh Corp. Our sister website is called www.pronoor.com along with other sites owned by Shaikh Corp. This document governs your relationship with <a href="https://www.pronoor.com">https://www.softral.com</a>\r\n . Access to and use of this Website and the products and services \r\navailable through this Website (collectively, the "Services") are \r\nsubject to the following terms, conditions and notices (the "Terms of \r\nService"). By using the Services, you are agreeing to all of the Terms \r\nof Service, as may be updated by us from time to time. You should check \r\nthis page regularly to take notice of any changes we may have made to \r\nthe Terms of Service. For Escrow related accounts please check the Escrow Contracts and Agreements.&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>Access to this Website is permitted on a temporary basis, and we \r\nreserve the right to withdraw or amend the Services without notice. We \r\nwill not be liable if for any reason this Website is unavailable at any \r\ntime or for any period. From time to time, we may restrict access to \r\nsome parts or all of this Website.</p>\r\n<p>This Website may contain links to other websites (the "Linked Sites"), which are not operated by <a href="http://www.pronoor.com">www.softralr.com</a>&nbsp; or by Shaikh Corp. Shaikh Corp.&nbsp;has no control over the &nbsp;Linked Sites not owned by Shaikh Corp and accepts no \r\nresponsibility for them or for any loss or damage that may arise from \r\nyour use of them. Your use of the Linked Sites will be subject to the \r\nterms of use and service contained within each such site.</p>\r\n<p><span style="line-height: 1.42857;">&nbsp;</span><strong style="line-height: 1.42857;">Privacy Policy&nbsp;</strong></p><p>Our privacy policy, which sets out how we will use your information, can be found at <a title="Privacy Policy" href="https://pronoor.com/index.php?page=6&amp;type=23">Privacy Policy</a>&nbsp;By using this Website, you consent to the processing described therein and warrant that all data provided by you is accurate.</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Prohibitions<br><br></strong> You must not misuse this \r\nWebsite. You will not: commit or encourage a criminal offense; transmit \r\nor distribute a virus, trojan, worm, logic bomb or any other material \r\nwhich is malicious, technologically harmful, in breach of confidence or \r\nin any way offensive or obscene; hack into any aspect of the Service; \r\ncorrupt data; cause annoyance to other users; infringe upon the rights \r\nof any other person''s proprietary rights; send any unsolicited \r\nadvertising or promotional material, commonly referred to as "spam"; or \r\nattempt to affect the performance or functionality of any computer \r\nfacilities of or accessed through this Website. Breaching this provision\r\n would constitute a criminal offense and www.pronoor.com will report any\r\n such breach to the relevant law enforcement authorities and disclose \r\nyour identity to them.</p>\r\n<p>&nbsp;<span style="line-height: 1.42857;">We will not be liable for any loss or damage caused by a distributed \r\ndenial-of-service attack, viruses or other technologically harmful \r\nmaterial that may infect your computer equipment, computer programs, \r\ndata or other proprietary material due to your use of this Website or to\r\n your downloading of any material posted on it, or on any website linked\r\n to it.</span></p>\r\n<p>&nbsp;<strong style="line-height: 1.42857;">Intellectual Property, Software and Content&nbsp;</strong></p><p>The intellectual property rights in all software and content (including\r\n photographic images) made available to you on or through this Website \r\nremains the property of <a href="http://www.pronoor.com">www.pronoor.com</a>\r\n or its licensors and are protected by copyright laws and treaties \r\naround the world. All such rights are reserved by www.ProNoor.com and \r\nits licensors. You may store, print and display the content supplied \r\nsolely for your own personal use. You are not permitted to publish, \r\nmanipulate, distribute or otherwise reproduce, in any format, any of the\r\n content or copies of the content supplied to you or which appears on \r\nthis Website nor may you use any such content in connection with any \r\nbusiness or commercial enterprise.</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Terms of Sale <br><br></strong> By placing an order you are \r\noffering to purchase a product on and subject to the following terms and\r\n conditions. All orders are subject to availability and confirmation of \r\nthe order price. <br>Dispatch times may vary according to \r\navailability and subject to any delays resulting from postal delays or \r\nforce majeure for which we will not be responsible.</p>\r\n<p>&nbsp;<span style="line-height: 1.42857;">In order to contract with </span><a href="http://www.pronoor.com" style="line-height: 1.42857; background-color: rgb(255, 255, 255);">www.pronoor.com</a><span style="line-height: 1.42857;"> you must be over 18 years of age and possess a valid credit or debit card issued by a bank acceptable to us. </span><a href="http://www.pronoor.com" style="line-height: 1.42857; background-color: rgb(255, 255, 255);">www.pronoor.com</a><span style="line-height: 1.42857;">\r\n retains the right to refuse any request made by you. If your order is \r\naccepted we will inform you by email and we will confirm the identity of\r\n the party which you have contracted with. This will usually be </span><a href="http://www.pronoor.com" style="line-height: 1.42857; background-color: rgb(255, 255, 255);">www.pronoor.com</a><span style="line-height: 1.42857;"> or may in some cases be a third party. Where a contract is made with a third party </span><a href="http://www.pronoor.com" style="line-height: 1.42857; background-color: rgb(255, 255, 255);">www.pronoor.com</a><span style="line-height: 1.42857;">\r\n is not acting as either agent or principal and the contract is made \r\nbetween yourself and that third party and will be subject to the terms \r\nof sale which they supply you. When placing an order you undertake that \r\nall details you provide to us are true and accurate, that you are an \r\nauthorized user of the credit or debit card used to place your order and\r\n that there are sufficient funds to cover the cost of the goods. The \r\ncost of foreign products and services may fluctuate. All prices \r\nadvertised are subject to such changes.</span></p>\r\n<p>&nbsp;<strong style="line-height: 1.42857;">(a) Our Contract&nbsp;</strong></p><p>When you place an order, \r\nyou will receive an acknowledgement e-mail confirming receipt of your \r\norder: this email will only be an acknowledgement and will not \r\nconstitute acceptance of your order. A contract between us will not be \r\nformed until we send you confirmation by e-mail that the goods which you\r\n ordered have been dispatched to you. Only those goods listed in the \r\nconfirmation e-mail sent at the time of dispatch will be included in the\r\n contract formed.</p>\r\n<p>&nbsp;<strong style="line-height: 1.42857;">(b) Pricing and Availability&nbsp;</strong></p><p><strong><br></strong> Whilst we try \r\nand ensure that all details, descriptions and prices which appear on \r\nthis Website are accurate, errors may occur. If we discover an error in \r\nthe price of any goods which you have ordered we will inform you of this\r\n as soon as possible and give you the option of reconfirming your order \r\nat the correct price or cancelling it. If we are unable to contact you \r\nwe will treat the order as cancelled. If you cancel and you have already\r\n paid for the goods, you will receive a full refund. <br><br> Delivery \r\ncosts will be charged in addition; such additional charges are clearly \r\ndisplayed where applicable and included in the ''Total Cost''.</p>\r\n<p>&nbsp;<strong style="line-height: 1.42857;">(c) Payment&nbsp;</strong></p><p>Upon receiving your order we \r\ncarry out a standard authorization check on your payment card to ensure \r\nthere are sufficient funds to fulfil the transaction. Your card will be \r\ndebited upon authorisation being received. The monies received upon the \r\ndebiting of your card shall be treated as a deposit against the value of\r\n the goods you wish to purchase. Once the goods have been despatched and\r\n you have been sent a confirmation email the monies paid as a deposit \r\nshall be used as consideration for the value of goods you have purchased\r\n as listed in the confirmation email.</p>\r\n<p>&nbsp;<strong style="line-height: 1.42857;">Disclaimer of Liability&nbsp;</strong></p><p>The material \r\ndisplayed on this Website is provided without any guarantees, conditions\r\n or warranties as to its accuracy. Unless expressly stated to the \r\ncontrary to the fullest extent permitted by law <a href="http://www.pronoor.com">www.pronoor.com</a>\r\n and its suppliers, content providers and advertisers hereby expressly \r\nexclude all conditions, warranties and other terms which might otherwise\r\n be implied by statute, common law or the law of equity and shall not be\r\n liable for any damages whatsoever, including but without limitation to \r\nany direct, indirect, special, consequential, punitive or incidental \r\ndamages, or damages for loss of use, profits, data or other intangibles,\r\n damage to goodwill or reputation, or the cost of procurement of \r\nsubstitute goods and services, arising out of or related to the use, \r\ninability to use, performance or failures of this Website or the Linked \r\nSites and any materials posted thereon, irrespective of whether such \r\ndamages were foreseeable or arise in contract, tort, equity, \r\nrestitution, by statute, at common law or otherwise. This does not \r\naffect <a href="http://www.pronoor.com">www.pronoor.com</a> ''s liability\r\n for death or personal injury arising from its negligence, fraudulent \r\nmisrepresentation, misrepresentation as to a fundamental matter or any \r\nother liability which cannot be excluded or limited under applicable \r\nlaw.</p>\r\n<p>&nbsp;<strong style="line-height: 1.42857;">Linking to this Website&nbsp;</strong></p><p>You may link to our\r\n home page, provided you do so in a way that is fair and legal and does \r\nnot damage our reputation or take advantage of it, but you must not \r\nestablish a link in such a way as to suggest any form of association, \r\napproval or endorsement on our part where none exists. You must not \r\nestablish a link from any website that is not owned by you. This Website\r\n must not be framed on any other site, nor may you create a link to any \r\npart of this Website other than the home page. We reserve the right to \r\nwithdraw linking permission without notice.</p>\r\n<p>&nbsp;<span style="line-height: 1.42857;">Disclaimer as to ownership of trade marks, images of personalities and third party copyright&nbsp;</span></p><p><span style="line-height: 1.42857;"><br></span><span style="line-height: 1.42857;">Except where expressly stated to the contrary all persons (including \r\ntheir names and images), third party trade marks and content, services \r\nand/or locations featured on this Website are in no way associated, \r\nlinked or affiliated with </span><a href="http://www.pronoor.com" style="line-height: 1.42857; background-color: rgb(255, 255, 255);">www.pronoor.com</a><span style="line-height: 1.42857;">\r\n and you should not rely on the existence of such a connection or \r\naffiliation. Any trade marks/names featured on this Website are owned by\r\n the respective trade mark owners. Where a trade mark or brand name is \r\nreferred to it is used solely to describe or identify the products and \r\nservices and is in no way an assertion that such products or services \r\nare endorsed by or connected to www.pronoor.com</span></p>\r\n<p>&nbsp;<strong style="line-height: 1.42857;">Indemnity&nbsp;</strong></p><p>You agree to indemnify, defend \r\nand hold harmless www.pronoor.com, its directors, officers, employees, \r\nconsultants, agents, and affiliates, from any and all third party \r\nclaims, liability, damages and/or costs (including, but not limited to, \r\nlegal fees) arising from your use this Website or your breach of the \r\nTerms of Service.</p>\r\n<p>&nbsp;<strong style="line-height: 1.42857;">Variation&nbsp;</strong></p><p><strong style="line-height: 1.42857;"><br></strong><a href="http://www.pronoor.com" style="line-height: 1.42857; background-color: rgb(255, 255, 255);">www.pronoor.com</a><span style="line-height: 1.42857;">\r\n shall have the right in its absolute discretion at any time and without\r\n notice to amend, remove or vary the Services and/or any page of this \r\nWebsite.</span></p>\r\n<p>&nbsp;<strong style="line-height: 1.42857;">Invalidity&nbsp;</strong></p><p>If any part of the Terms of \r\nService is unenforceable (including any provision in which we exclude \r\nour liability to you) the enforceability of any other part of the Terms \r\nof Service will not be affected all other clauses remaining in full \r\nforce and effect. So far as possible where any clause/sub-clause or part\r\n of a clause/sub-clause can be severed to render the remaining part \r\nvalid, the clause shall be interpreted accordingly. Alternatively, you \r\nagree that the clause shall be rectified and interpreted in such a way \r\nthat closely resembles the original meaning of the clause /sub-clause as\r\n is permitted by law.</p>\r\n<p>&nbsp;<strong style="line-height: 1.42857;">Complaints&nbsp;</strong></p><p><strong><br></strong> We operate a complaints handling\r\n procedure which we will use to try to resolve disputes when they first \r\narise, please let us know if you have any complaints or comments.</p>\r\n<p>&nbsp;<strong style="line-height: 1.42857;">Waiver&nbsp;</strong></p><p>If you breach these conditions and \r\nwe take no action, we will still be entitled to use our rights and \r\nremedies in any other situation where you breach these conditions.</p>\r\n<p><strong style="line-height: 1.42857;">Entire Agreement&nbsp;</strong></p><p><span style="line-height: 1.42857;">The above Terms of Service\r\n constitute the entire agreement of the parties and supersede any and \r\nall preceding and contemporaneous agreements between you and </span><a href="https://www.pronoor.com" style="line-height: 1.42857; background-color: rgb(255, 255, 255);">https://softral.com</a><span style="line-height: 1.42857;">. Any waiver of any provision of the Terms of Service will be effective only if in writing and signed by a Director of </span><a href="https://www.pronoor.com" style="line-height: 1.42857; background-color: rgb(255, 255, 255);">https://www.softral.com</a></p>\r\n\r\n            </div>', '', '1', 5, 'rules-conditions'),
(9, 'Why we want such a good person in our country?', '<p>You must give answer for this? That why we need such a great person in our country to lead?<br></p><p><br></p><p>You must give answer for this? That why we need such a great person in our country to lead?<br></p><p><br></p><p>You must give answer for this? That why we need such a great person in our country to lead?<br></p><p><br></p><p>You must give answer for this? That why we need such a great person in our country to lead?<br></p><p><br></p><p><br></p><p><br></p>', '', '1', 6, 'why-we-want-such-a-good-person-in-our-country'),
(10, 'Privacy Policy', '<p><strong><a href="https://pronoor.com">https://softral.com</a> Privacy Policy</strong><br><br>\r\n This privacy policy has been compiled to better serve those who are \r\nconcerned with how their "Personally identifiable information" (PII) is \r\nbeing used online. PII, as used in US privacy law and information \r\nsecurity, is information that can be used on its own or with other \r\ninformation to identify, contact, or locate a single person, or to \r\nidentify an individual in context. Please read our privacy policy \r\ncarefully to get a clear understanding of how we collect, use, protect \r\nor otherwise handle your Personally Identifiable Information in \r\naccordance with our website. <strong><br><br>What personal information do we collect from the people that visit our blog, website or app?</strong></p>\r\n<p>&nbsp;</p>\r\n<p>When ordering or registering on our site, as appropriate, you may be \r\nasked to enter your name, email address, mailing address, phone number, \r\ncredit card information or other details to help you with your \r\nexperience.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>When do we collect information?</strong></p>\r\n<p>&nbsp;</p>\r\n<p>We collect information from you when you register on our site, place an order, fill out a form or enter information on our site.<br><br></p>\r\n<p><br><br></p>\r\n<p><strong>How do we use your information?</strong></p>\r\n<p>&nbsp;</p>\r\n<p>We may use the information we collect from you when you register, \r\nmake a purchase, sign up for our newsletter, respond to a survey or \r\nmarketing communication, surf the website, or use certain other site \r\nfeatures in the following ways:</p>\r\n<ul><li>To allow us to better service you in responding to your customer service requests.</li><li>To quickly process your transactions.</li><li>To send periodic emails regarding your order or other products and services.</li></ul>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p><strong>How do we protect visitor information?</strong></p>\r\n<p>&nbsp;</p>\r\n<p>Our website is scanned on a regular basis for security holes and \r\nknown vulnerabilities in order to make your visit to our site as safe as\r\n possible.</p>\r\n<p>We use regular Malware Scanning.</p>\r\n<p>Your personal information is contained behind secured networks and is\r\n only accessible by a limited number of persons who have special access \r\nrights to such systems, and are required to keep the information \r\nconfidential. In addition, all sensitive/credit information you supply \r\nis encrypted via Secure Socket Layer (SSL) technology.</p>\r\n<p>&nbsp;</p>\r\n<p>We implement a variety of security measures when a user places an \r\norder enters, submits, or accesses their information to maintain the \r\nsafety of your personal information.</p>\r\n<p>&nbsp;</p>\r\n<p>For your convenience we may store your credit card information longer\r\n than 30 days in order to expedite future orders, and to automate the \r\nbilling process.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Do we use cookies?</strong></p>\r\n<p>&nbsp;</p>\r\n<p>We do not use cookies for tracking purposes</p>\r\n<p><br>You can choose to have your computer warn you each time a cookie \r\nis being sent, or you can choose to turn off all cookies. You do this \r\nthrough your browser (like Internet Explorer) settings. Each browser is a\r\n little different, so look at your browsers Help menu to learn the \r\ncorrect way to modify your cookies.</p>\r\n<p>&nbsp;</p>\r\n<p>If you disable cookies off, some features will be disabled that make \r\nyour site experience more efficient and some of our services will not \r\nfunction properly.</p>\r\n<p>&nbsp;</p>\r\n<p>However, you can still place orders .<br><br></p>\r\n<p><strong>Third Party Disclosure</strong></p>\r\n<p>&nbsp;</p>\r\n<p>We do not sell, trade, or otherwise transfer to outside parties your personally identifiable information.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Third party links</strong></p>\r\n<p>&nbsp;</p>\r\n<p>We do not include or offer third party products or services on our website.</p>\r\n<p><strong>Google</strong></p>\r\n<p>&nbsp;</p>\r\n<p>Google advertising requirements can be summed up by Google \r\nAdvertising Principles. They are put in place to provide a positive \r\nexperience for users.&nbsp;<a href="https://support.google.com/adwordspolicy/answer/1316548?hl=en" target="_blank">https://support.google.com/<wbr>adwordspolicy/answer/1316548?<wbr>hl=en</a></p>\r\n<p>We have not enabled Google AdSense on our site and we may never do so in the future.</p>\r\n<p><strong>California Online Privacy Protection Act</strong></p>\r\n<p>CalOPPA is the first state law in the nation to require commercial \r\nwebsites and online services to post a privacy policy. The law''s reach \r\nstretches well beyond California to require a person or company in the \r\nUnited States (and conceivably the world) that operates websites \r\ncollecting personally identifiable information from California consumers\r\n to post a conspicuous privacy policy on its website stating exactly the\r\n information being collected and those individuals with whom it is being\r\n shared, and to comply with this policy. - See more at: \r\nhttp://consumercal.org/california-online-privacy-protection-act-caloppa/#sthash.0FdRbT51.dpuf</p>\r\n<p><strong>According to CalOPPA we agree to the following:</strong></p>\r\n<p>Users can visit our site anonymously</p>\r\n<p>Once this privacy policy is created, we will add a link to it on our \r\nhome page, or as a minimum on the first significant page after entering \r\nour website.</p>\r\n<p>Our Privacy Policy link includes the word ''Privacy'', and can be easily be found on the page specified above.</p>\r\n<p>Users will be notified of any privacy policy changes:</p>\r\n<ul><li>On our Privacy Policy Page</li></ul>\r\n<p>Users are able to change their personal information:</p>\r\n<ul><li>By emailing us</li><li>By logging in to their account</li><li>By chatting with us or sending us a ticket</li></ul>\r\n<p><strong>How does our site handle do not track signals?</strong></p>\r\n<p>We honor do not track signals and do not track, plant cookies, or use\r\n advertising when a Do Not Track (DNT) browser mechanism is in place.</p>\r\n<p><strong>Does our site allow third party behavioral tracking?</strong></p>\r\n<p>It''s also important to note that we do not allow third party behavioral tracking</p>\r\n<p><strong>COPPA (Children Online Privacy Protection Act)</strong></p>\r\n<p>When it comes to the collection of personal information from children\r\n under 13, the Children''s Online Privacy Protection Act (COPPA) puts \r\nparents in control. The Federal Trade Commission, the nation''s consumer \r\nprotection agency, enforces the COPPA Rule, which spells out what \r\noperators of websites and online services must do to protect children''s \r\nprivacy and safety online.</p>\r\n<p>We do not specifically market to children under 13.</p>\r\n<p><strong>Fair Information Practices</strong></p>\r\n<p>The Fair Information Practices Principles form the backbone of \r\nprivacy law in the United States and the concepts they include have \r\nplayed a significant role in the development of data protection laws \r\naround the globe. Understanding the Fair Information Practice Principles\r\n and how they should be implemented is critical to comply with the \r\nvarious privacy laws that protect personal information.</p>\r\n<p><strong>In order to be in line with Fair Information Practices we will take the following responsive action, should a data breach occur:</strong></p>\r\n<p>We will notify the users via email</p>\r\n<ul><li>Within 7 business days</li></ul>\r\n<p>We will notify the users via in site notification</p>\r\n<ul><li>Within 7 business days</li></ul>\r\n<p>We also agree to the individual redress principle, which requires \r\nthat individuals have a right to pursue legally enforceable rights \r\nagainst data collectors and processors who fail to adhere to the law. \r\nThis principle requires not only that individuals have enforceable \r\nrights against data users, but also that individuals have recourse to \r\ncourts or a government agency to investigate and/or prosecute \r\nnon-compliance by data processors.</p>\r\n<p><strong>CAN SPAM Act</strong></p>\r\n<p>The CAN-SPAM Act is a law that sets the rules for commercial email, \r\nestablishes requirements for commercial messages, gives recipients the \r\nright to have emails stopped from being sent to them, and spells out \r\ntough penalties for violations.</p>\r\n<p><strong>We collect your email address in order to:</strong></p>\r\n<ul><li>Send information, respond to inquiries, and/or other requests or questions.</li><li>Process orders and to send information and updates pertaining to orders</li><li>We may also send you additional information related to your product and/or service.</li><li>Market to our mailing list or continue to send emails to our clients after the original transaction has occurred</li></ul>\r\n<p><strong>To be in accordance with CANSPAM we agree to the following:</strong></p>\r\n<ul><li>NOT use false, or misleading subjects or email addresses</li><li>Identify the message as an advertisement in some reasonable way</li><li>Include the physical address of our business or site headquarters</li><li>Monitor third party email marketing services for compliance, if one is used.</li><li>Honor opt-out/unsubscribe requests quickly</li><li>Allow users to unsubscribe by using the link at the bottom of each email</li></ul>\r\n<p><strong>If at any time you would like to unsubscribe from receiving future emails, you can email us at</strong></p>\r\n<p>Admin@pronoor.com and we will promptly remove you from ALL correspondence.</p>\r\n<p><strong>Contacting Us</strong></p>\r\n<p>If there are any questions regarding this privacy policy you may contact us using the information below. <br> <a href="https://pronoor.com">https://pronoor.com</a><br> 4325 Downtowner Loop N<br> Mobile, Alabama 36609<br> USA<br>ameens@pronoor.com<br><br> Last Edited on 2015-06-27</p>', '', '1', 0, 'privacy-policy'),
(11, 'Profile', '<p><span style="font-family: ''Arial Black'';">A good profile is a gateway to success</span>. Here are some important points that you should consider while adding information to your profile.</p><p>Name........First.......Last Name.......</p><p>Address: .......................................State........... Country............</p><p>Phone Number..... Email:............</p><p>Education:</p><p>High School.......................</p><p>College2007.........................Major Subjects:....................</p><p>University 2009........................Major Subjects</p><p>Experience:</p><p>2010-2015: &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;Software Engineer at Shaikh Corp, Mobile AL, USA</p><p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;Supervised Electronic Health Record program development by using PHP and JAVA</p><p>2009-2010 &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; Web Developer at Local Host corporation,Istanbul, Turkey</p><p><br></p><p>You don,t need to add too much detail of your work but always mention about your skills to enhance your profile.</p><p>Picture: Add a picture to your profile. As a freelancer you want to give a human face to your resume. In classic job posting you did not need a picture but in this age of cyber employment, your picture adds to the legitimacy of your profile. BUT please always have a professional looking picture.</p>', '', '1', 4, 'profile'),
(12, 'Payments', '<p>Softral will make payments to the freelancers or sellers by using the following rule.</p><p>Softral will try it''s best to help freelancers and sellers save maximum money by paying less commissions or fees.&nbsp;</p><p>Softral will offer employers or buyers to enjoy the best products and services at a very reasonable and competitive cost.</p><p>Freelancer Fees:</p><p>$1.00-100 will pay $3.00 as a fixed flat fee</p><p>$101-500 will pay 5.8%</p><p>$501-unlimited &nbsp;will pay 6.9%</p><p>The above fees are for Western Union direct deposit to your bank account and by using Skrill payment service.</p><p>Expedited Delivery is available with an additional fee by using your method of preferred payment receive.</p><p><span style="text-decoration: underline;">EMPLOYERS OR BUYERS</span></p><p>There is no fee or commission is charged when transactions between an employer and freelancer are regular direct and no additional Softral service is utilized. Following are the additional services available to employers:</p><p>A: premium Account: With a nominal fee you can enjoy this service to place and project your job posting to attract maximum number of intellectuals and experts for the job.</p><p>B: 1099 Expense reporting or similar Expense reporting available&nbsp;</p><p>C: Money Back: Satisfactory Job completion with quality work guarantee. Softral will help you protect your investment by providing full money back guarantee with an additional fee. This fee is based on the cost of your project and payments made for the freelancer services. This guarantee is only for the quality of the work as described at the time of contract between a freelancer and an employer. Please read our Terms and conditions for more details.</p><p>D: Corporate Assistant: Softral provides a special service to corporate clients to meet their short term or long term needs in hiring freelancers. Please contact us and we will be happy to provide you the best service.</p><p><br></p><p>&nbsp;</p>', '', '1', 4, 'payments');
