/pages/links1" target="_blank">Fixed Price Dispute Resolution Policy</a></span></a><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt;"><span style="text-decoration: underline; color: rgb(8, 82, 148);"></span></font></font><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt;"></font></font><font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt">\r\nif the Private Talent Cloud Client and Freelancer have submitted a\r\nSupplemental Escrow Instruction evidencing their agreement not to use\r\nthose policies for Disputes over a Fixed Price Escrow Account. </font></font></font>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in;">\r\n<br>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in"><font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt">	</font></font></font><font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 11pt"><b>3.Dormant\r\nEngagements</b></font></font></font></p><p align="JUSTIFY" style="margin-bottom: 0in;">\r\n<br>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in"><font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt">Shaikh\r\nCorp. has a procedure for speeding up Fixed Price Engagements that\r\nappear Dormant. For purposes of determining Dormant status,\r\n“</font></font></font><font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt"><b>activity</b></font></font></font><font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt">”\r\nmeans business term or milestone updates or requests, Fixed Price\r\nEscrow Funding, Fixed Price Escrow Release, Fixed Price Escrow\r\nRefunds, Funding requests, Release requests, Engagement Cancellation\r\nrequests, Status Report submittals, or actions under the Fixed Price\r\nDispute Resolution Policy.</font></font></font></p><p align="JUSTIFY" style="margin-bottom: 0in;">\r\n<font color="#000000"> </font>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in"><font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt">If\r\na Fixed Price Engagement has a Fixed Price Escrow Account with a\r\nbalance but has had no activity for 60 consecutive days after the\r\nlast milestone date contained in the business terms, then the\r\nEngagement will be “</font></font></font><font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt"><b>Dormant</b></font></font></font><font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt">.”\r\nDormant Engagements are subject to the following rules: </font></font></font>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in;">\r\n<br>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0.12in"><font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt">	1.\r\nSoftral will notify Client when the Engagement becomes Dormant\r\n(</font></font></font><font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt"><b>“Dormant\r\nDate</b></font></font></font><font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt">”).\r\n</font></font></font>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0.12in;">\r\n<font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt">	2.If\r\nno activity other than Release requests has occurred within 7 days\r\nafter the Dormant Date, Softral will notify 	Freelancer that the\r\nEngagement is Dormant.</font></font></font></p><p align="JUSTIFY" style="margin-bottom: 0.12in;">\r\n<font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt">	3.If\r\nno activity other than Release requests has occurred within an\r\nadditional 7 days (14 days from the Dormant 	Date), Freelancer and\r\nClient agree that Softral is authorized and irrevocably instructed to\r\n(i) immediately release to 	Freelancer amounts related to milestones\r\nwith Release requests that are 30 days or older; (ii) release to\r\nFreelancer 	In 30 days from the date of the applicable Release\r\nrequest any amounts related to milestones with Release 	requests\r\nyounger than 30 days; and (iii) immediately release to Client any\r\namounts remaining in the Escrow 	Account for the Dormant Engagement\r\nthereafter, or any amount not subject to a prior Release request.</font></font></font></p><ol>\r\n	\r\n		<ol start="3">\r\n			<p align="JUSTIFY" style="margin-bottom: 0in;">\r\n			</p>\r\n		</ol>\r\n	\r\n</ol><p align="JUSTIFY" style="margin-bottom: 0in;">\r\n<font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt">All\r\nfunds released to Freelancer under this Section will be subject to\r\nthe applicable Service Fees for Freelancers. All funds released to\r\nClient are subject to a fee of 3.75% of the released funds, and\r\nClient irrevocably authorizes and instructs Softral to deduct the fee\r\namount from the Client Escrow Account and pay the fee to Shaikh\r\nCorp.. </font></font></font>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in;">\r\n<br>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in;">\r\n<font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 11pt"><b>	4.\r\nContacting Us</b></font></font></font></p><p align="JUSTIFY" style="margin-bottom: 0in;">\r\n<br>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in;">\r\n<font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt">If\r\nyou wish to report a violation of the Terms of Service, have any\r\nquestions, or need assistance, please contact Customer Support as\r\nfollows: </font></font></font>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in;">\r\n<br>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in"><font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt"><b>Web\r\nSupport: </b></font></font></font><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt;"><span style="text-decoration: underline; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial; color: rgb(8, 82, 148);"><a href="http://www.softral.com/help" target="_blank">http://www.softral.com/help</a></span></font></font><font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt">\r\n</font></font></font>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt;"><b>Email:</b></font></font><a href="mailto:admin@softral.com" target="_blank">admin@softral.com</a><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt;"><b><span style="text-decoration: underline; color: rgb(8, 82, 148);"></span></b></font></font><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt;"></font></font><font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt">\r\n</font></font></font>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in"><font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt"><b>Phone:\r\n</b></font></font></font><font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt">1-251-366-8081\r\n</font></font></font>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in;">\r\n<font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt">(Monday\r\n12:01 AM through Friday 12:00 AM Midnight Central Time) </font></font></font>\r\n</p><p align="JUSTIFY">\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt;"><b>Online\r\nHelp Topics:<span style="text-decoration: underline; color: rgb(8, 82, 148);"><a href=" http://www.softral.com/help" target="_blank"> </a></span></b></font></font><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt;"><span style="text-decoration: underline; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial; color: rgb(8, 82, 148);"><a href=" http://www.softral.com/help" target="_blank">http://www.softral.com/help</a></span></font></font><font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt">\r\n</font></font></font>\r\n</p>', '', '1', 4, 'escrow-account-agreements');
