to the\r\nAccount Agreement and one or more of the Release Conditions described\r\nin the applicable Escrow Instructions.</font></font></font></font></p><p align="JUSTIFY" style="margin-bottom: 0in"><br>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in"><font color="#000000">“<font face="Georgia, serif"><font style="font-size: 9pt"><font face="Arial-BoldMT, sans-serif"><b>Escrow\r\nServices” </b></font><font face="ArialMT, sans-serif">means the\r\nescrow services provided by Softral pursuant to the Account Agreement\r\nand the applicable Escrow Instructions.</font></font></font></font></p><p align="JUSTIFY" style="margin-bottom: 0in"><br>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in"><font color="#000000">“<font face="Georgia, serif"><font style="font-size: 9pt"><font face="Arial-BoldMT, sans-serif"><b>Fixed\r\nPrice Engagement” </b></font><font face="ArialMT, sans-serif">means\r\nan Engagement where Client has offered or agreed to pay Freelancer a\r\nfixed price for Freelancer Services and/or Deliverables.</font></font></font></font></p><p align="JUSTIFY" style="margin-bottom: 0in"><br>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in"><font color="#000000">“<font face="Georgia, serif"><font style="font-size: 9pt"><font face="Arial-BoldMT, sans-serif"><b>Freelancer”\r\n</b></font><font face="ArialMT, sans-serif">means a Member that\r\nadvertises and provides services or identifies a Client through the\r\nSite. The term “Freelancer” includes, without limitation, a\r\nMember that becomes a Payroll Employee.</font></font></font></font></p><p align="JUSTIFY" style="margin-bottom: 0in"><br>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in"><font color="#000000">“<font face="Georgia, serif"><font style="font-size: 9pt"><font face="Arial-BoldMT, sans-serif"><b>Freelancer\r\nServices” </b></font><font face="ArialMT, sans-serif">means all\r\nservices provided or delivered to Clients by Freelancers.</font></font></font></font></p><p align="JUSTIFY" style="margin-bottom: 0in"><br>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in"><font color="#000000">“<font face="Georgia, serif"><font style="font-size: 9pt"><font face="Arial-BoldMT, sans-serif"><b>Hourly\r\nEngagement” </b></font><font face="ArialMT, sans-serif">means an\r\nEngagement where Client has offered or agreed to pay Freelancer at a\r\nspecified hourly rate for the Freelancer Services.</font></font></font></font></p><p align="JUSTIFY" style="margin-bottom: 0in"><br>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in"><font color="#000000">“<font face="Georgia, serif"><font style="font-size: 9pt"><font face="Arial-BoldMT, sans-serif"><b>Intellectual\r\nProperty Rights” </b></font><font face="ArialMT, sans-serif">means\r\nall patent rights, copyright rights, mask work rights, moral rights,\r\nrights of publicity, trademark, trade dress and service mark rights,\r\ngoodwill, trade secret rights, and other intellectual property rights\r\nas may now exist or hereafter come into existence, and all\r\napplications therefore and registrations, renewals, and extensions\r\nthereof, under the laws of any state, country, territory, or other\r\njurisdiction.</font></font></font></font></p><p align="JUSTIFY" style="margin-bottom: 0in"><br>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in"><font color="#000000">“<font face="Georgia, serif"><font style="font-size: 9pt"><font face="Arial-BoldMT, sans-serif"><b>may”\r\n</b></font><font face="ArialMT, sans-serif">means a party has the\r\nright to take an action.</font></font></font></font></p><p align="JUSTIFY" style="margin-bottom: 0in"><br>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in"><font color="#000000">“<font face="Georgia, serif"><font style="font-size: 9pt"><font face="Arial-BoldMT, sans-serif"><b>Mandatory\r\nTerms” </b></font><font face="ArialMT, sans-serif">means all\r\nprovisions of the Terms of Service other than (i) the Independent\r\nContractor Services Agreement; and (ii) if the Client is a Private\r\nTalent Cloud Client, the Refund and Cancellation Policy and the\r\nDispute Resolution Policies.</font></font></font></font></p><p align="JUSTIFY" style="margin-bottom: 0in"><br>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in"><font color="#000000">“<font face="Georgia, serif"><font style="font-size: 9pt"><font face="Arial-BoldMT, sans-serif"><b>Member”\r\n</b></font><font face="ArialMT, sans-serif">means a person or legal\r\nentity that registers for an Account.</font></font></font></font></p><p align="JUSTIFY" style="margin-bottom: 0in"><br>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in"><font color="#000000">“<font face="Georgia, serif"><font style="font-size: 9pt"><font face="Arial-BoldMT, sans-serif"><b>Member\r\nContract” </b></font><font face="ArialMT, sans-serif">means (1) the\r\nRelationship Agreements applicable to the Engagement; (2) the\r\nremaining Terms of Service (other than the Relationship Agreements);\r\n(3) the Engagement terms, as awarded and accepted on the Site, to the\r\nextent not inconsistent with the Mandatory Terms; and (4) any other\r\ncontractual provisions between Client and Freelancer and uploaded to\r\nthe Site, to the extent not inconsistent with the Mandatory Terms.</font></font></font></font></p><p align="JUSTIFY" style="margin-bottom: 0in"><br>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in"><font color="#000000">“<font face="Georgia, serif"><font style="font-size: 9pt"><font face="Arial-BoldMT, sans-serif"><b>Payment\r\nMethod” </b></font><font face="ArialMT, sans-serif">means a valid\r\ncredit card issued by a bank acceptable to Shaikh Corp., a bank\r\naccount linked to your Account, a PayPal account, or such other\r\nmethod of payment as Softral or Shaikh Corp. may accept from time to\r\ntime in their sole discretion.</font></font></font></font></p><p align="JUSTIFY" style="margin-bottom: 0in"><br>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in"><font color="#000000">“<font face="Georgia, serif"><font style="font-size: 9pt"><font face="Arial-BoldMT, sans-serif"><b>Payroll\r\nEmployee” </b></font><font face="ArialMT, sans-serif">means a\r\nFreelancer accepted for employment by a payroll services company\r\nselected by Shaikh Corp. and assigned by that company via the Site to\r\nprovide Freelancer Services to one or more Client(s).</font></font></font></font></p><p align="JUSTIFY" style="margin-bottom: 0in"><br>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in"><font color="#000000">“<font face="Georgia, serif"><font style="font-size: 9pt"><font face="Arial-BoldMT, sans-serif"><b>Private\r\nTalent Cloud Client” </b></font><font face="ArialMT, sans-serif">means\r\na Client that has entered into a separate written agreement with\r\nShaikh Corp. or our Affiliates for Private Talent Cloud services as\r\nspecified in such written agreement.</font></font></font></font></p><p align="JUSTIFY" style="margin-bottom: 0in"><br>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in"><font color="#000000">“<font face="Georgia, serif"><font style="font-size: 9pt"><font face="Arial-BoldMT, sans-serif"><b>Relationship\r\nAgreements” </b></font><font face="ArialMT, sans-serif">means the\r\n(1) Independent Contractor Services Agreement; (2) Fixed Price Escrow\r\nInstructions; (3) Hourly and Miscellaneous Payment Agreement with\r\nEscrow Instructions; and (4) Payroll Services Agreement.</font></font></font></font></p><p align="JUSTIFY" style="margin-bottom: 0in"><br>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in"><font color="#000000">“<font face="Georgia, serif"><font style="font-size: 9pt"><font face="Arial-BoldMT, sans-serif"><b>Release\r\nCondition” </b></font><font face="ArialMT, sans-serif">means a\r\ncondition for release of funds from an Escrow Account pursuant to the\r\nEscrow Instructions.</font></font></font></font></p><p align="JUSTIFY" style="margin-bottom: 0in"><br>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in"><font color="#000000">“<font face="Georgia, serif"><font style="font-size: 9pt"><font face="Arial-BoldMT, sans-serif"><b>Secure\r\nAreas” </b></font><font face="ArialMT, sans-serif">means portions\r\nof the Site that are encrypted using the Hypertext Transfer Protocol\r\nSecure (also known as “HTTPS”) or any other encryption mechanism.</font></font></font></font></p><p align="JUSTIFY" style="margin-bottom: 0in"><br>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in"><font color="#000000">“<font face="Georgia, serif"><font style="font-size: 9pt"><font face="Arial-BoldMT, sans-serif"><b>Service\r\nFee” </b></font><font face="ArialMT, sans-serif">means a fee that\r\nShaikh Corp. earns for creating, hosting, maintaining, and providing\r\nthe Site and Site Services. Shaikh Corp. does not introduce\r\nFreelancers to Clients or help Freelancers to find Engagements, and\r\ntherefore earns no fee when a Freelancer identifies a suitable Client\r\nor finds an Engagement.</font></font></font></font></p><p align="JUSTIFY" style="margin-bottom: 0in"><br>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in"><font color="#000000">“<font face="Georgia, serif"><font style="font-size: 9pt"><font face="Arial-BoldMT, sans-serif"><b>Services\r\nAgreement” </b></font><font face="ArialMT, sans-serif">means the\r\ndefault </font><font color="#315cff"><font face="ArialMT, sans-serif">Independent\r\nContractor Services Agreement </font></font><font face="ArialMT, sans-serif">that\r\nmay be modified by Client and Freelancer as described </font><font color="#315cff"><font face="ArialMT, sans-serif">here</font></font><font face="ArialMT, sans-serif">.\r\nA Services Agreement may include specifications, price, milestones,\r\ndeliverables, hours, payment terms, warranties, and other contractual\r\nobligations.</font></font></font></font></p><p align="JUSTIFY" style="margin-bottom: 0in"><br>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in"><font color="#000000">“<font face="Georgia, serif"><font size="2"><font face="Arial-BoldMT, sans-serif"><font style="font-size: 9pt"><b>Site”\r\n</b></font></font><font face="ArialMT, sans-serif"><font style="font-size: 9pt">means\r\nthe domain and all subdomains of softral.com and any mobile or web\r\nservices or applications owned, controlled, or offered by Shaikh\r\nCorp. or Softral.</font></font></font></font></font></p><p align="JUSTIFY" style="margin-bottom: 0in"><br>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in"><font color="#000000">“<font face="Georgia, serif"><font size="2"><font face="Arial-BoldMT, sans-serif"><font style="font-size: 9pt"><b>Site\r\nPolicies” </b></font></font><font face="ArialMT, sans-serif"><font style="font-size: 9pt">means\r\nthe Terms of Service and all obligations, requirements, and\r\nguidelines contained in or linked from the Site. Site Policies\r\nincludes, without limitation, all documents linked </font></font><font color="#315cff"><font face="ArialMT, sans-serif"><font style="font-size: 9pt">here</font></font></font><font face="ArialMT, sans-serif"><font style="font-size: 9pt">.</font></font></font></font></font></p><p align="JUSTIFY" style="margin-bottom: 0in"><br>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in"><font color="#000000">“<font face="Georgia, serif"><font size="2"><font face="Arial-BoldMT, sans-serif"><font style="font-size: 9pt"><b>Site\r\nServices” </b></font></font><font face="ArialMT, sans-serif"><font style="font-size: 9pt">means\r\nall services that are accessible through the Site whether provided by\r\nShaikh Corp., Softral, an Affiliate or a third party, other than a\r\nFreelancer. Site Services includes the Third-Party Services, but\r\nexcludes Freelancer Services.</font></font></font></font></font></p><p align="JUSTIFY" style="margin-bottom: 0in"><br>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in"><font color="#000000">“<font face="Georgia, serif"><font size="2"><font face="Arial-BoldMT, sans-serif"><font style="font-size: 9pt"><b>Team\r\nAccount” </b></font></font><font face="ArialMT, sans-serif"><font style="font-size: 9pt">means\r\nan account established by a Member adding Users to the Member’s\r\nAccount to act on behalf of and perform roles assigned by the Member.</font></font></font></font></font></p><p align="JUSTIFY" style="margin-bottom: 0in"><br>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in"><font color="#000000">“<font face="Georgia, serif"><font size="2"><font face="Arial-BoldMT, sans-serif"><font style="font-size: 9pt"><b>Team\r\nAccount Administrator” </b></font></font><font face="ArialMT, sans-serif"><font style="font-size: 9pt">means\r\na Team Member with account administration privileges for a Team\r\nAccount.</font></font></font></font></font></p><p align="JUSTIFY" style="margin-bottom: 0in"><br>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in"><font color="#000000">“<font face="Georgia, serif"><font size="2"><font face="Arial-BoldMT, sans-serif"><font style="font-size: 9pt"><b>Team\r\nMember” </b></font></font><font face="ArialMT, sans-serif"><font style="font-size: 9pt">means\r\nany User added to a Team Account.</font></font></font></font></font></p><p align="JUSTIFY" style="margin-bottom: 0in"><br>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in"><font color="#000000">“<font face="Georgia, serif"><font size="2"><font face="Arial-BoldMT, sans-serif"><font style="font-size: 9pt"><b>Terms\r\nof Service” </b></font></font><font face="ArialMT, sans-serif"><font style="font-size: 9pt">means\r\nthis Agreement and all the other Site information agreements and\r\npolicies referenced or linked </font></font><font color="#315cff"><font face="ArialMT, sans-serif"><font style="font-size: 9pt">here</font></font></font><font face="ArialMT, sans-serif"><font style="font-size: 9pt">.</font></font></font></font></font></p><p align="JUSTIFY" style="margin-bottom: 0in"><br>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in"><font color="#000000">“<font face="Georgia, serif"><font size="2"><font face="Arial-BoldMT, sans-serif"><fon