r reliability. Shaihk Corp. reserves the right to remove or\r\nrestrict access to any information, content, or Engagements posted or\r\nmade available on the Site in our sole discretion, if ordered to do\r\nso by a court, or if Shaihk Corp. considers such information or\r\ncontent to be in violation of the Terms of Service. </font></font></font>\r\n</p><p style="margin-bottom: 0in;"><br>\r\n</p><p style="margin-bottom: 0in;"><font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 11pt"><b>	3.\r\nNon-Circumvention </b></font></font></font>\r\n</p><p style="margin-bottom: 0in;">\r\n<br>\r\n</p><p style="margin-bottom: 0in"><font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt">You\r\nacknowledge and agree that, pursuant to and for the reasons stated in\r\nthe </font></font></font><font color="#0000ff"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt"><u>User\r\nAgreement</u></font></font></font><font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt">,\r\nfor 24 months from the time you identify or are identified by any\r\nparty through the Site, you must use the Site as your exclusive\r\nmethod to request, make and receive all payments for any services\r\ndirectly or indirectly provided to or received from that party or\r\narising out of your relationship with that party. You may opt-out of\r\nthis obligation only if the prospective Client pays Shaihk Corp. an\r\n“Opt-Out Fee” as detailed in the </font></font></font><font color="#0000ff"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt"><u>User\r\nAgreement</u></font></font></font><font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt">\r\nin the section titled “</font></font></font><font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt"><b>Non-Circumvention</b></font></font></font><font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt">”.\r\n</font></font></font>\r\n</p><p style="margin-bottom: 0in;"><br>\r\n</p><p style="margin-bottom: 0in;"><font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 11pt"><b>	4.\r\nThumbnail Images and Profiles </b></font></font></font>\r\n</p><p style="margin-bottom: 0in;">\r\n<br>\r\n</p><p style="margin-bottom: 0in;">\r\n<font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt">You\r\nmay post a thumbnail image on the Site to accompany your Account\r\nprofile. All thumbnails must follow these common guidelines: </font></font></font>\r\n</p><p style="margin-bottom: 0in;">\r\n<br>\r\n</p><p style="margin-bottom: 0.13in;">\r\n<font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt">	•\r\nYou must own the image or have a license to use, copy, and sublicense\r\nthe image. </font></font></font>\r\n</p><p style="margin-bottom: 0.13in;">\r\n<font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt">	•\r\nThe image must be professional. </font></font></font>\r\n</p><p style="margin-bottom: 0.13in;">\r\n<font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt">	•\r\nPlease upload .jpg, .jpeg, or .gif files (40x50 pixels). Animated\r\n.gif files are not allowed. </font></font></font>\r\n</p><p style="margin-bottom: 0in;">\r\n<font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt">	•\r\nThe thumbnail may be left blank. </font></font></font>\r\n</p><p style="margin-bottom: 0in;">\r\n<br>\r\n</p><p style="margin-bottom: 0in;">\r\n<font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt">If\r\nyou are an individual Member, then in addition to the common\r\nguidelines above, your thumbnail image also must follow these\r\nguidelines: </font></font></font>\r\n</p><p style="margin-bottom: 0in;">\r\n<br>\r\n</p><p style="margin-bottom: 0.13in;">\r\n<font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt">	•\r\nThe image must be a portrait that is a truthful representation or you\r\n(i.e., no stock photos, fakes, or logos). </font></font></font>\r\n</p><p style="margin-bottom: 0.13in;">\r\n<font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt">	•\r\nAn avatar of reasonable likeness is acceptable. </font></font></font>\r\n</p><p style="margin-bottom: 0.13in;">\r\n<font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt">	•\r\nGroup photos are not acceptable. Please remove other individuals from\r\nthe image. </font></font></font>\r\n</p><p style="margin-bottom: 0in;">\r\n<font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt">	•\r\nVery small images are not acceptable. You must be identifiable in the\r\nimage. </font></font></font>\r\n</p><p style="margin-bottom: 0in;">\r\n<br>\r\n</p><p style="margin-bottom: 0in;">\r\n<font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt">If\r\nyou are a company Member, then in addition to the common guidelines\r\nabove, your thumbnail image also must follow these guidelines: </font></font></font>\r\n</p><p style="margin-bottom: 0in;">\r\n<br>\r\n</p><p style="margin-bottom: 0.13in;">\r\n<font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt">	•\r\nThe image may be a logo, a portrait of you or your company, or a\r\nrelevant piece of your work. </font></font></font>\r\n</p><p style="margin-bottom: 0in;">\r\n<font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt">	•\r\nIf the image is a portrait, it must be a truthful representation\r\n(i.e., no stock photos or fakes). </font></font></font>\r\n</p><p style="margin-bottom: 0in;">\r\n<br>\r\n</p><p style="margin-bottom: 0in;"><font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 11pt"><b>	5.\r\nPortfolio Images </b></font></font></font>\r\n</p><p style="margin-bottom: 0in;">\r\n<br>\r\n</p><p style="margin-bottom: 0in;">\r\n<font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt">You\r\nmay post images on the Site to accompany your portfolio. All\r\nportfolio images must follow these common guidelines: </font></font></font>\r\n</p><p style="margin-bottom: 0in;">\r\n<br>\r\n</p><p style="margin-bottom: 0.13in;">\r\n<font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt">	•\r\nYou must own the image or have a license to use, copy, and sublicense\r\nthe image. </font></font></font>\r\n</p><p style="margin-bottom: 0.13in;">\r\n<font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt">	•\r\nAnimated .gif images are not allowed. </font></font></font>\r\n</p><p style="margin-bottom: 0.13in;">\r\n<font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt">	•\r\nEach image in your portfolio must be unique (you are not permitted to\r\nhave two of the same exact file/image). </font></font></font>\r\n</p><p style="margin-bottom: 0.13in;">\r\n<font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt">	•\r\nImage files (.jpg, .jpeg, .gif, .png, etc.) must be images of your\r\nworks of authorship, not images of other 	promotional materials, such\r\nas your resume or company marketing materials. </font></font></font>\r\n</p><p style="margin-bottom: 0in;">\r\n<font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt">	•\r\nThe image should be a fair and accurate representation of your work. </font></font></font>\r\n</p><p style="margin-bottom: 0in;">\r\n<br>\r\n</p><p style="margin-bottom: 0in;">\r\n<font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt">We\r\nretain the right to remove a portfolio image for any reason, even if\r\nnot listed above. </font></font></font>\r\n</p><p style="margin-bottom: 0in;">\r\n<br>\r\n</p><p style="margin-bottom: 0in;"><font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 11pt"><b>	6.\r\nProhibited Site Activities </b></font></font></font>\r\n</p><p style="margin-bottom: 0in;">\r\n<br>\r\n</p><p style="margin-bottom: 0in;">\r\n<font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt">You\r\nagree NOT to do any of the following on the Site: </font></font></font>\r\n</p><p style="margin-bottom: 0in;">\r\n<br>\r\n</p><p style="margin-bottom: 0in;">\r\n<font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt">	•\r\nCopy, reproduce, modify, create derivative works from, distribute, or\r\npublicly display any content (other than your 	own User Content) from\r\nthe Site, any software code that is part of the Site, or any services\r\nthat are offered on the 	Site without the prior express written\r\npermission of Shaihk Corp. and the appropriate third party, as\r\napplicable. </font></font></font>\r\n</p><p style="margin-bottom: 0in;">\r\n<br>\r\n</p><p style="margin-bottom: 0.13in;">\r\n<font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt">	•\r\nPost false or misleading information about a product, service, or\r\nservice request. </font></font></font>\r\n</p><p style="margin-bottom: 0.13in;">\r\n<font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt">	•\r\nPost logos, seals, or slogans from third parties on the Site unless\r\nsuch material is provided by Shaihk Corp. or a 	third-party\r\ndesignated by Shaihk Corp. or you have received express written\r\npermission from Shaihk Corp. to 	display such third-party logo, seal,\r\nor slogan. </font></font></font>\r\n</p><p style="margin-bottom: 0.13in;">\r\n<font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt">	•\r\nPost or transmit any content that is profane, vulgar, racist,\r\noffensive, threatening, harmful, abusive, defamatory, or\r\n	disparaging. </font></font></font>\r\n</p><p style="margin-bottom: 0.13in;">\r\n<font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt">	•\r\nPost or transmit unprofessional or offensive comments about a User,\r\nMember, Freelancer, Client, Shaihk Corp., or 	any third party. </font></font></font>\r\n</p><p style="margin-bottom: 0.13in;">\r\n<font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt">	•\r\nSuggest or solicit another User to contact you directly in order to\r\nbuy or sell services outside of Shaihk Corp.. </font></font></font>\r\n</p><p style="margin-bottom: 0.13in;">\r\n<font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt">	•\r\nTamper with postings of other Users, Members, or Shaihk Corp.. </font></font></font>\r\n</p><p style="margin-bottom: 0.13in"><font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt">	•\r\nSolicit or gather any User’s or Member’s information available\r\nfrom the Site, such as other usernames and email 	addresses, for any\r\npurpose other than to use the Site Services in accordance with the\r\nTerms of Service. </font></font></font>\r\n</p><p style="margin-bottom: 0.13in;">\r\n<font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt">	•\r\nImpersonate or misrepresent your affiliation with any person or\r\nentity. </font></font></font>\r\n</p><p style="margin-bottom: 0.13in;">\r\n<font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt">	•\r\nRequire or request that a Freelancer deliver a free mock-up or proof\r\nof concept as part of a proposal submission or 	as a condition to\r\nconsideration of a proposal. </font></font></font>\r\n</p><p style="margin-bottom: 0.13in;">\r\n<font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt">	•\r\nRepeat any action after you receive warning or request to desist from\r\nShaihk Corp., whether or not that action is 	explicitly prohibited in\r\nthe policies stated on the Site. </font></font></font>\r\n</p><p style="margin-bottom: 0.13in;">\r\n<font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt">	•\r\nFail to respond to an email from Shaihk Corp. regarding violation,\r\ndispute, or complaint within two Business Days 	of when Shaihk Corp.\r\nsent such email. </font></font></font>\r\n</p><p style="margin-bottom: 0.13in;">\r\n<font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt">	•\r\nUse the Site if you are not able to form legally binding contracts,\r\nare under age 18, or are temporarily or indefinitely 	suspended from\r\naccessing the Site, or if you do not have authority to accept the\r\nUser Agreement on behalf of a 	Member for whom you are accessing the\r\nSite. </font></font></font>\r\n</p><p style="margin-bottom: 0.13in;">\r\n<font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt">	•\r\nTake any action that may undermine the feedback or ratings systems\r\n(such as importing or exporting feedback 	information off the Site or\r\nusing feedback as an extortion mechanism). </font></font></font>\r\n</p><p style="margin-bottom: 0.13in;">\r\n<font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt">	•\r\nSelect a Client or engage a Freelancer on the basis of religion, sex,\r\nor race. </font></font></font>\r\n</p><p style="margin-bottom: 0in;">\r\n<font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt">	•\r\nViolate a request by Shaihk Corp. to not post Engagements deemed by\r\nShaihk Corp., in our sole discretion, to be 	contrary to the\r\ninterests of the Site or the User community. </font></font></font>\r\n</p><p style="margin-bottom: 0in;">\r\n<br>\r\n</p><p style="margin-bottom: 0in;"><font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 11pt"><b>	7.\r\nFeedback </b></font></font></font>\r\n</p><p style="margin-bottom: 0in;">\r\n<br>\r\n</p><p style="margin-bottom: 0in;">\r\n<font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt">For\r\nthe benefit of Users of the Site Services, Shaihk Corp. encourages\r\nyou to leave objective, balanced feedback about Users with whom you\r\nhave transacted. You acknowledge and agree that feedback results for\r\nyou will consist of comments and ratings left by other Users and that\r\nShaihk Corp. will make available to other Users a composite feedback\r\nnumber based on these individual ratings. Shaihk Corp. provides\r\nfeedback as a means through which Users can share their opinions\r\npublicly, and Shaihk Corp. does not monitor or censor these opinions.\r\nShaihk Corp. does not investigate any remarks posted by Users for\r\naccuracy or reliability unless a User requests Shaihk Corp. to do so.\r\nYou may be held legally responsible for damages suffered by other\r\nUsers or third parties as a result of your remarks if a court finds\r\nthat your remarks are legally actionable or defamatory. Shaihk Corp.\r\nis not legally responsible for any feedback or comments posted or\r\nmade available on the Site by any Users or third parties, even if\r\nthat information is defamatory or otherwise legally actionable. In\r\norder to protect the integrity of the feedback system and protect\r\nUsers from abuse, Shaihk Corp. reserves the right (but is under no\r\nobligation) to remove posted feedback or information that in Shaihk\r\nCorp.’s sole judgment violates the Terms of Service or negatively\r\naffects our User community or operations. </font></font></font>\r\n</p><p style="margin-bottom: 0in;">\r\n<br>\r\n</p><p style="margin-bottom: 0in"><font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt">You\r\nagree to report violations or abuses of our feedback system\r\nimmediately by contacting </font></font></font><font color="#0000ff"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt"><u>Customer\r\nSupport</u></font></font></font><font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt">\r\nand agree not to take any actions that undermine the integrity of the\r\nfeedback system, including, but not limited to, the following: </font></font></font>\r\n</p><p style="margin-bottom: 0.13in;">\r\n<br><br>\r\n</p><p style="margin-bottom: 0.13in;">\r\n<font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt">	•\r\nLeaving feedback for yourself using a different username or another\r\nMember’s username. </font></font></font>\r\n</p><p style="margin-bottom: 0.13in;">\r\n<font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt">	•\r\nLeaving fake or inaccurate feedback for another User or Member. </font></font></font>\r\n</p><p style="margin-bottom: 0.13in;">\r\n<font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt">	•\r\nSoliciting other Members to leave fake or inaccurate feedback. </font></font></font>\r\n</p><p style="margin-bottom: 0.13in;">\r\n<font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt">	•\r\nThreatening to leave negative feedback to induce another User or\r\nMember to perform a task not required by the 	Member Contract. </font></font></font>\r\n</p><p style="margin-bottom: 0.13in;">\r\n<font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt">	•\r\nWithholding deliverables or funds required by the Member Contract to\r\ninduce another User or Member to leave 	positive feedback or no\r\nfeedback. </font></font></font>\r\n</p><p style="margin-bottom: 0in;">\r\n<font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt">	•\r\nEngaging in feedback solicitation, such as offering to sell or buy\r\nservices in exchange for good feedback, trading 	feedback\r\nundeservedly, or buying feedback. </font></font></font>\r\n</p><p style="margin-bottom: 0in;">\r\n<br>\r\n</p><p style="margin-bottom: 0in;">\r\n<font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt">In\r\norder to protect the integrity of the feedback system and protect\r\nUsers from abuse, Shaihk Corp. may investigate and has the right (but\r\nis under no obligation) to remove posted feedback or information\r\nunder the following scenarios:</font></font></font></p><p style="margin-bottom: 0in;">\r\n<font color="#000000"> </font>\r\n</p><p style="margin-bottom: 0.13in;">\r\n<font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt">	•\r\nIt seeks to elicit or solicit any User’s contact information, such\r\nas other Users’ email addresses, for any non-Site 	related\r\ncommercial or business purposes or to transmit any unsolicited\r\nadvertising such as “junk mail,” “spam,” or 	“chain\r\nletters.” </font></font></font>\r\n</p><p style="margin-bottom: 0.13in;">\r\n<font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt">	•\r\nIt contains language that is profane, vulgar, racist, or otherwise\r\ndiscriminatory, hate speech, or contains adult 	material. Insulting\r\nor inflammatory feedback is strongly discouraged but might not be\r\nremoved absent other factors. </font></font></font>\r\n</p><p style="margin-bottom: 0.13in;">\r\n<font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt">	•\r\nIt is shown to have been left by any User who is in violation of the\r\nTerms of Service or by or for a User who has 	conducted any\r\nfraudulent transaction. </font></font></font>\r\n</p><p style="margin-bottom: 0.13in;">\r\n<font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt">	•\r\nIt is not directly related to transactions conducted through the\r\nSite. </font></font></font>\r\n</p><p style="margin-bottom: 0.13in;">\r\n<font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt">	•\r\nIt makes any reference to actions taken or purported to be taken by\r\nShaihk Corp. or any law enforcement 	organization. </font></font></font>\r\n</p><p style="margin-bottom: 0.13in;">\r\n<font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt">	•\r\nShaihk Corp. is provided with a ruling or settlement agreement from a\r\nvalid and certified dispute resolution service 	or is provided with a\r\ncourt order finding that the feedback or information posted is\r\nslanderous, libelous, defamatory, 	or otherwise illegal. </font></font></font>\r\n</p><p style="margin-bottom: 0.13in;">\r\n<font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt">	•\r\nThe User who posted the feedback or information provided Shaihk Corp.\r\nwith false contact information (as verified 	by Shaihk Corp.) and\r\ncannot be contacted by Shaihk Corp.. </font></font></font>\r\n</p><p style="margin-bottom: 0.13in;">\r\n<font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt">	•\r\nThe User who posted the feedback or information is using the Site\r\nwith the intent of leaving feedback as part of a 	campaign to harass\r\nUsers or Members (in Shaihk Corp.’s sole judgment). </font></font></font>\r\n</p><p style="margin-bottom: 0in"><font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt">	•\r\nThe User who posted the feedback or information informs Shaihk Corp.\r\nthat it was intended for another User and 	posts the feedback or\r\ninformation for the appropriate User. This does not apply to feedback\r\nthat was mistakenly 	marked negative instead of positive or vice\r\nversa, in which case the User can contact </font></font></font><font color="#0000