<b>	1.\r\nIntroduction </b></font></font></font>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in;">\r\n<br>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in"><font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt">To\r\ncancel an Engagement or request a refund, you must first submit the\r\nEngagement Cancellation Form or the Refund Request Form available in\r\nthe Workroom. The other party to the Engagement will then have five\r\ndays (the “</font></font></font><font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt"><b>Approval\r\nPeriod</b></font></font></font><font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt">”)\r\nto either approve your request or submit the Dispute Notice Form\r\navailable in the Workroom. You must then follow the applicable\r\nprocess described below. </font></font></font>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in;">\r\n<br>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in;"><font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 11pt"><b>	2.\r\nEngagement Cancellation Form </b></font></font></font>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in;">\r\n<br>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in;">\r\n<font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt">If\r\nyou submit an Engagement Cancellation Form, the following process\r\nwill apply: </font></font></font>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0.12in;">\r\n<br><br>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0.12in;">\r\n<font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt">	a)\r\nIf the other party approves your request, then the Engagement is\r\ncancelled. </font></font></font>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0.12in"><font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt">	b)\r\nIf the other party submits a Dispute Notice Form during the Approval\r\nPeriod, then you are required to use the 	</font></font></font><font color="#0000ff"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt"><u>Fixed\r\nPrice Dispute Resolution Policy</u></font></font></font><font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt">\r\nor the </font></font></font><font color="#0000ff"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt"><u>Hourly\r\nDispute Resolution Policy</u></font></font></font><font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt">,\r\ndepending on the Engagement type. </font></font></font>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in"><font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt">	c)\r\nIf the other party fails to submit Dispute Notice Form during the\r\nApproval Period, then the Engagement will be 	cancelled and: (i) if\r\nthe Engagement is a Fixed Price Engagement, funds will be released\r\nfrom the Fixed Price 	Escrow Account and returned to the applicable\r\nClient Escrow Account to the extent of any funded balance and\r\n	subject to the terms and conditions of the other Terms of Service;\r\n(ii) for any remaining balance, and for Hourly 	Engagements, you are\r\nrequired to use the </font></font></font><font color="#0000ff"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt"><u>Fixed\r\nPrice Dispute Resolution Policy</u></font></font></font><font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt">\r\nor the </font></font></font><font color="#0000ff"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt"><u>Hourly\r\nDispute Resolution</u></font></font></font><font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt">\r\n	</font></font></font><font color="#0000ff"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt"><u>Policy</u></font></font></font><font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt">,\r\ndepending on the Engagement type; and (iii) Shaihk Corp. may suspend\r\nor cancel the other party’s Account. </font></font></font>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in;">\r\n<br>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in;"><font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 11pt"><b>	3.\r\nRefund Request Form </b></font></font></font>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in;"><br>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in;"><font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt"><b>Freelancer\r\n</b></font></font></font>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in;">\r\n<br>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in;">\r\n<font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt">If\r\na Freelancer submits a Refund Request Form, the request is deemed\r\napproved and Freelancer will be deemed to have issued the applicable\r\nRefund Escrow Instructions below. </font></font></font>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in;"><br>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in;"><font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt"><b>Client\r\n</b></font></font></font>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in;">\r\n<br>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in;">\r\n<font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt">If\r\na Client submits a Refund Request Form, then the following process\r\nwill apply: </font></font></font>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0.12in;">\r\n<br><br>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0.12in"><font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt">	a)\r\nIf Freelancer approves Clien