color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt">These\r\nMark Use Guidelines (“</font></font></font><font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt"><b>Guidelines</b></font></font></font><font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt">”)\r\nare a part of and incorporate all terms, conditions, rules, policies,\r\nand guidelines on the Site, including the </font></font></font><font color="#0000ff"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt"><u>Terms\r\nof Service</u></font></font></font><font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt">\r\n(“</font></font></font><font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt"><b>Terms\r\nof Service</b></font></font></font><font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt">”).\r\nCapitalized terms not defined in these Guidelines are defined in the\r\n</font></font></font><font color="#0000ff"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt"><u>User\r\nAgreement</u></font></font></font><font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt">\r\nor in the other Terms of Service or have the meanings given such\r\nterms on the Site. Your use of the Shaikh Corp. Mark after the\r\neffective date will signify your acceptance of and agreement to these\r\nGuidelines. To the extent permitted by applicable law, Shaikh Corp.\r\nmay modify these Guidelines without prior notice to you, and any\r\nrevisions to these Guidelines will take effect when posted on the\r\nSite, unless otherwise stated in the revised Guidelines. Please check\r\nthe Site often for updates.</font></font></font></p><p align="JUSTIFY" style="margin-bottom: 0in;">\r\n<font color="#000000"> </font>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in;"><font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 11pt"><b>	1.\r\nIntroduction </b></font></font></font>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in;">\r\n<br>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in"><font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt">These\r\nGuidelines explain the terms under which you are allowed to use the\r\nShaikh Corp. name and its graphical representation (the “</font></font></font><font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt"><b>Shaikh\r\nCorp. Mark</b></font></font></font><font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt">”).\r\nThe Shaikh Corp. Mark is among our most valuable assets. In order to\r\npreserve and strengthen our identity, these Guidelines provide\r\nconditions of use and clear instructions on proper use of the Shaikh\r\nCorp. Mark. </font></font></font>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in;"><br>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in;"><font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 11pt"><b>	2.\r\nPreconditions </b></font></font></font>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in;">\r\n<br>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in;">\r\n<font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt">You\r\nmust only use the Shaikh Corp. Mark if you have a written license,\r\ngranted by Shaikh Corp., permitting you to use the Shaikh Corp. Mark.\r\nIf you do not have been granted such a license by Shaikh Corp., then\r\nyou must not use, copy, modify, distribute, or post the Shaikh Corp.\r\nMark for any reason. If you have such a license from Shaikh Corp. to\r\nuse the Shaikh Corp. Mark, you must use the Shaikh Corp. Mark only as\r\nlicensed and only in accordance with these Guidelines. </font></font></font>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in;"><br>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in;"><font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 11pt"><b>	3.\r\nThe Shaikh Corp. Mark </b></font></font></font>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in;">\r\n<br>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in;">\r\n<font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt">The\r\nShaikh Corp. Mark is a typed drawing in a deliberate font and certain\r\ncolors. The following illustrations below are the only renditions of\r\nthe Shaikh Corp. Mark you may use, subject to the terms of these\r\nGuidelines. </font></font></font>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in;">\r\n<br>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in;">\r\n<font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt">The\r\nShaikh Corp. Mark is federally registered with the United States\r\nPatent and Trademark Office and with the applicable regulatory\r\nauthorities in certain other nations. All uses of the Shaikh Corp.\r\nMark must bear the ® designation. </font></font></font>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in;">\r\n<br>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in;">\r\n<font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt">When\r\nusing the Shaikh Corp. Mark, you must provide sufficient contrast\r\nbetween background color and the Shaikh Corp. Mark to ensure good\r\ncontrast and clear legibility. </font></font></font>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in;"><br>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in;"><font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 11pt"><b>	4.\r\nMinimum Size </b></font></font></font>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in;">\r\n<br>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in;">\r\n<font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt">In\r\norder to ensure sharp reproductions of the Shaikh Corp. Mark, you\r\nmust print the width of the Shaikh Corp. Mark at least 30 pixels\r\nhigh. </font></font></font>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in;"><br>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in;"><font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 11pt"><b>	5.\r\nArea of Non-Interference </b></font></font></font>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in;">\r\n<br>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in;">\r\n<font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt">The\r\narea of non-interference is a clear zone around the Shaikh Corp.\r\nMark. In order to ensure visibility and impact and to present the\r\nShaikh Corp. Mark without competition from other typographical or\r\ngraphical elements, the minimum area of non-interference must be at\r\nleast the equivalent of the height of one-half the Shaikh Corp. “E”\r\naround all four sides of the Shaikh Corp. Mark. </font></font></font>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in;"><br>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in;"><font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 11pt"><b>	6.\r\nAvoiding Improper Use of the Shaikh Corp. Mark </b></font></font></font>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in;">\r\n<br>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in;">\r\n<font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt">You\r\nmust: </font></font></font>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in;">\r\n<br>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0.13in;">\r\n<font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt">	•\r\nNever reproduce the Shaikh Corp. Mark from unauthorized artwork; </font></font></font>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0.13in;">\r\n<font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt">	•\r\nNot modify the Shaikh Corp. Mark, including color specifications,\r\nposition and relative size of the letterings; </font></font></font>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0.13in;">\r\n<font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt">	•\r\nNever present the Shaikh Corp. Mark using negative or reverse\r\n“drop-out” reproduction; </font></font></font>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0.13in;">\r\n<font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt">	•\r\nNever confine the Shaikh Corp. Mark tightly in a band or bar; </font></font></font>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0.13in;">\r\n<font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt">	•\r\nNever present other seals, logos, or other marks in close proximity\r\nto the Shaikh Corp. Mark; </font></font></font>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0.13in;">\r\n<font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt">	•\r\nNot use the Shaikh Corp. Mark in association with any third-party\r\ntrademark in a manner that might create 	potential confusion as to\r\nthe ownership of the Shaikh Corp. Mark; and </font></font></font>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in;">\r\n<font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt">	•\r\nNot use the Shaikh Corp. Mark outside of your relationship with us,\r\nexcept as permitted by Shaikh Corp. in writing. </font></font></font>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in;">\r\n<br>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in;"><font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 11pt"><b>	7.\r\nUse of the Shaikh Corp. Mark on the Internet </b></font></font></font>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in;">\r\n<br>\r\n</p>