gn="JUSTIFY" style="margin-bottom: 0in"><br>\r\n</p><p align="CENTER" style="margin-bottom: 0in"><font color="#000000">\r\n</font><font color="#000000"><font face="Georgia, Georgia, serif"><font size="5">Hourly\r\nDispute Resolution Policy </font></font></font>\r\n</p><p align="CENTER" style="margin-bottom: 0in;"><br>\r\n</p><p align="CENTER" style="margin-bottom: 0in;"><br>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in;"><font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt">Effective\r\nDate: May 5, 2015 </font></font></font>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in;"><br>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in;"><br>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in"><font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt">This\r\nHourly Dispute Resolution Policy (this “</font></font></font><font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt"><b>Policy</b></font></font></font><font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt">”)\r\nincorporates all terms, conditions, rules, policies, and guidelines\r\non the Site, including the other </font></font></font><font color="#0000ff"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt"><u>Terms\r\nof Service</u></font></font></font><font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt">.\r\nCapitalized terms not defined in this Policy are defined in the </font></font></font><font color="#0000ff"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt"><u>User\r\nAgreement</u></font></font></font><font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt">\r\nor in the other Terms of Service or have the meanings given such\r\nterms on the Site. Your use of the Site after the effective date will\r\nsignify your acceptance of and agreement to this Policy. To the\r\nextent permitted by applicable law, we may modify this Policy without\r\nprior notice to you, and any revisions to this Policy will take\r\neffect when posted on the Site, unless otherwise stated in the\r\nrevised Policy. Please check the Site often for updates. </font></font></font>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in;">\r\n<br>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in"><font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt">This\r\nPolicy provides the mechanism for Members to resolve cancellation\r\nrequests, refunds, and other Disputes that could arise from an Hourly\r\nEngagement. This Policy does not cover feedback posted on the Site.\r\nIf you have a complaint involving feedback, please refer to the\r\nsection titled “</font></font></font><font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt"><b>Rating\r\nand Feedback System</b></font></font></font><font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt">”\r\nin the </font></font></font><font color="#0000ff"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt"><u>Site\r\nUsage Policy</u></font></font></font><font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt">.\r\nThis Policy does not cover Disputes relating to Fixed Price\r\nEngagements. If you have a Dispute relating to a Fixed Price\r\nEngagement, please refer to the Cancellation and Refund Request\r\nPolicy and the Fixed Price Dispute Resolution Policy. If you have\r\nentered into the Payroll Services Agreement for your Engagement, this\r\nPolicy does not apply. If you have a dispute with Shaikh Corp. or our\r\nAffiliates, please contact Customer Support for assistance. Disputes\r\nwith Shaikh Corp. and our Affiliates are governed by the </font></font></font><font color="#0000ff"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt"><u>User\r\nAgreement</u></font></font></font><font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt">.\r\n</font></font></font>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in;">\r\n<br>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in;"><font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 11pt"><b>	1.\r\nIntroduction to Dispute Resolution for Hourly Engagements </b></font></font></font>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in;">\r\n<br>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in;">\r\n<font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt">If\r\nthe Cancellation and Refund Request Policy fails to resolve your\r\nissue, or if you have other unresolved Disputes arising out of an\r\nHourly Engagement, you must follow the applicable processes described\r\nin the remainder of this Policy, depending on the type and status of\r\nEngagement in Dispute. </font></font></font>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in;">\r\n<br>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in;">\r\n<font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt">To\r\nbegin Dispute resolution for an Hourly Engagement without Work View,\r\na Member must first submit a Dispute Notice Form in the Workroom. The\r\nMember may submit a Dispute Notice Form to resolve a complaint or to\r\nrespond to a request for refund or cancellation of the Engagement.\r\nShaikh Corp. will notify the other party of the Dispute, and the\r\nClient and Freelancer then will have two Business Days from delivery\r\nof such notice to resolve the Dispute between them and document the\r\nresolution in the Workroom. Shaikh Corp. will close the Dispute if\r\nthere is no resolution posted in the Workroom within those two\r\nBusiness Days. If the Hourly Engagement does not use Work View,\r\nShaikh Corp. cannot offer further Dispute assistance.</font></font></font></p><p align="JUSTIFY" style="margin-bottom: 0in;">\r\n<font color="#000000"> </font>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in;">\r\n<font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt">If\r\nyour Engagement uses Work View, Shaikh Corp. may offer further\r\nDispute assistance as detailed below. </font></font></font>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in;"><br>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in;"><font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 11pt"><b>	2.\r\nHourly Engagements with Work View </b></font></font></font>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in;">\r\n<br>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in;">\r\n<font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt">To\r\nbegin Dispute resolution for an Hourly Engagement with Work View, you\r\nare required to follow the processes below: </font></font></font>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in;"><br>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in;"><font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt"><b>If\r\nClient Rejects Time:</b></font></font></font></p><p align="JUSTIFY" style="margin-bottom: 0in;">\r\n<br>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in"><font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt">For\r\nan Hourly Engagement with Work View, Client has the right to reject\r\ntime submitted by Freelancer on a timesheet if Client in good faith\r\nbelieves screenshots in the Workroom show the time submitted by\r\nFreelancer is not related to the Engagement requirements or Client\r\ninstructions. To exercise this right, Client must use the Workroom to\r\nreject the applicable time by Friday at 11:59 PM Eastern Time, USA,\r\nfollowing Freelancer’s submission of timesheets (the “</font></font></font><font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt"><b>Timesheet\r\nReview Period</b></font></font></font><font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt">”).\r\nAt the end of the Timesheet Review Period, Softral or its subsidiary\r\nwill automatically charge Client’s Payment Method for all time not\r\nrejected by Client pursuant to this Policy, and Client irrevocably\r\nwaives its right to Shaikh Corp.’s Dispute assistance concerning\r\nthat time. </font></font></font>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in;">\r\n<br>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in;"><font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt"><b>If\r\nFreelancer Disagrees </b></font></font></font>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in;"><br>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in;">\r\n<font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt">If\r\nFreelancer in good faith believes Client has rejected time that is\r\nrelated to the Engagement requirements or Client instructions, then\r\nFreelancer has the right to submit a Dispute Notice Form in the\r\nWorkroom within five Business Days of delivery of notice of Client’s\r\nrejection. </font></font></font>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in;">\r\n<br>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in;">\r\n<font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt">For\r\nall time not rejected by Client in the Timesheet Review Period,\r\npayment is due by the end of the Timesheet Review Period. If Client\r\ndoes not make such payment, Freelancer has the right to submit a\r\nDispute Notice Form in the Workroom for that Engagement within five\r\nBusiness Days following the end of the Timesheet Review Period.</font></font></font></p><p align="JUSTIFY" style="margin-bottom: 0in;">\r\n<font color="#000000"> </font>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in;"><font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt"><b>Shaikh\r\nCorp. Dispute Assistance </b></font></font></font>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in;">\r\n<br>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in;">\r\n<font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt">If\r\nFreelancer Disputes Client’s rejection of time for an Hourly\r\nEngagement with Work View, Shaikh Corp. will determine, in Shaikh\r\nCorp.’s sole discretion, whether the disputed time is related to\r\nthe Engagement requirements or Client’s instructions documented in\r\nthe Workroom. If Shaikh Corp. determines that the time is related to\r\nthe Engagement requirements or Client’s instructions documented in\r\nthe Workroom, Softral or its subsidiary will charge Client’s\r\nPayment Method for the rejected time, and Softral will release the\r\nfunds to Freelancer under the Hourly and Miscellaneous Payment\r\nAgreement with Escrow Instructions. </font></font></font>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in;">\r\n<font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt">If\r\nFreelancer files a Dispute Notice Form in the Workroom because Client\r\ndid not pay for time that has not been rejected by Client, Softral or\r\nits subsidiary will charge Client’s Payment Method for the rejected\r\ntime, and Softral will release the funds to Freelancer under the\r\n<font color="#0000ff"><u>Hourly and Miscellaneous Payment Escrow\r\nInstructions</u></font>.</font></font></font></p><p align="JUSTIFY" style="margin-bottom: 0in;">\r\n<font color="#000000"> </font>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in;">\r\n<font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt">Engagements\r\nprohibited by the Terms of Service do not qualify for Dispute\r\nassistance under this Policy. </font></font></font>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in;">\r\n<br>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in;"><font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 11pt"><b>	3.\r\nPosting Notice of Resolution </b></font></font></font>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in;">\r\n<br>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in;">\r\n<font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt">Any\r\nagreement resolving a Dispute must be posted and confirmed by both\r\nparties in their Workroom. </font></font></font>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in;"><br>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in;"><font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 11pt"><b>	4.\r\nFailure to Comply with this Policy </b></font></font></font>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in;">\r\n<br>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in;">\r\n<font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt">All\r\nclaims, disputes, or other disagreements between you and another\r\nMember that are covered by this Policy must be resolved in accordance\r\nwith the terms in this Policy. All claims filed or brought contrary\r\nto this Policy will be considered improperly filed and Shaikh Corp.\r\nwill have the right to take action, including suspension or closure\r\nof your Account. Should you file a claim contrary to this Policy, the\r\nother Member may recover attorneys’ fees and costs up to $2,000,\r\nprovided that the other Member has notified you in writing of the\r\nimproperly filed claim, and you fail to promptly withdraw the claim. </font></font></font>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in;"><br>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in;"><font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 11pt"><b>	5.\r\nAbuse </b></font></font></font>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in;">\r\n<br>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in;">\r\n<font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt">Shaikh\r\nCorp., in its sole discretion, reserves the right to suspend or close\r\nyour Account immediately upon giving notice to you if Shaikh Corp.\r\nbelieves you may be abusing this Policy or as otherwise permitted by\r\nthe other Terms of Service. However, any Disputes for any Engagement\r\nthat existed prior to closure of your Account will be subject to the\r\nTerms of Service. </font></font></font>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in;"><br>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in;"><font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 11pt"><b>	6.\r\nContacting Us </b></font></font></font>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in;">\r\n<br>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in;">\r\n<font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt">If\r\nyou wish to report a violation of the Terms of Service, have any\r\nquestions, or need assistance, please contact Customer Support at: </font></font></font>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in;">\r\n<br>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in"><font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt"><b>Web\r\nSupport: </b></font></font></font><font color="#0000ff"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt"><u>http://www.softral.com/help</u></font></font></font><font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt">\r\n</font></font></font>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in"><font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt"><b>Email:\r\n</b></font></font></font><font color="#0000ff"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt"><u>admin@softral.com</u></font></font></font><font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt">\r\n</font></font></font>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in"><font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt"><b>Phone:\r\n</b></font></font></font><font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt">1-251-633-0801\r\n</font></font></font>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in;">\r\n<font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt">(Monday\r\n12:01 AM through Friday 12:00 AM Midnight Central Time) </font></font></font>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in">\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n<font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt">\r\n</font></font></font>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in"><font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt"><b>Online\r\nHelp Topics: </b></font></font></font><font color="#0000ff"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt"><u>http://www.softral.com/help&nbsp;</u></font></font></font></p><p align="JUSTIFY" style="margin-bottom: 0in"><font color="#0000ff"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt"><u><br></u></font></font></font></p><p align="JUSTIFY" style="margin-bottom: 0in"><font color="#0000ff"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt"><u><br></u></font></font></font></p><p align="JUSTIFY" style="margin-bottom: 0in"><br>\r\n</p><p align="CENTER" style="margin-bottom: 0in"><font color="#000000">\r\n</font><font color="#000000"><font face="Georgia, Georgia, serif"><font size="5">Freelancer\r\nMemberships, Proposals and Fulfillment Policy </font></font></font>\r\n</p><p align="CENTER" style="margin-bottom: 0in;"><br>\r\n</p><p align="CENTER" style="margin-bottom: 0in;"><br>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in;"><font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt">Effective\r\nDate: November 10, 2015 </font></font></font>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in;"><br>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in"><font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt">This\r\nFreelancer Memberships, Proposals, and Performance Policy (this\r\n“</font></font></font><font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt"><b>Policy</b></font></font></font><font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt">”)\r\nis part of and incorporates by reference all terms, conditions rules,\r\npolicies, and guidelines on the Site, including the </font></font></font><font color="#0000ff"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt"><u>Terms\r\nof Service</u></font></font></font><font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt">\r\n(the “</font></font></font><font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt"><b>Terms\r\nof Service</b></font></font></font><font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt">”).\r\nYour use of the Site after the effective date will signify your\r\nacceptance of and agreement to this Policy. To the extent permitted\r\nby applicable law, we may modify this Policy without prior notice to\r\nyou, and any revisions to this Policy will take effect when posted on\r\nthe Site, unless otherwise stated in the revised Policy. Please check\r\nthe Site often for updates. Capitalized terms not defined in this\r\nPolicy are defined in the </font></font></font><font color="#0000ff"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt"><u>User\r\nAgreement</u></font></font></font><font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt">\r\nor in the other Terms of Service or have the meanings given such\r\nterms on the Site.</font></font></font></p><p align="JUSTIFY" style="margin-bottom: 0in;">\r\n<font color="#000000"> </font>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in;"><font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 11pt"><b>	1.\r\nFreelancer Membership Programs </b></font></font></font>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in;">\r\n<br>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in;">\r\n<font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt">Shaikh\r\nCorp. offers several Freelancer membership programs. If you are an\r\nindividual and will be the only person associated with your Account,\r\nyou may register as an individual Member or a company Member, free or\r\npaid. If your organization consists of more than one person, or if\r\nyour service is operated or delivered by more than one person, you\r\nmust register as a business Member, free or paid, and must not\r\nregister as an individual Member. </font></font></font>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in;">\r\n<br>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in"><font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt">Each\r\nmembership program includes a certain number of “</font></font></font><font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt"><b>Connects</b></font></font></font><font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt">,”\r\nwhich reserve monthly capacity on the Site for Freelancer to list\r\nproposals for Engagements. Subject to a cap determined by your\r\nmembership program and other criteria, including, but not limited to,\r\nyour feedback on the Site, Freelancer may buy additional Connects\r\nthrough the Site at any time. Connects you do not use by the end of\r\nthe month do not carry over into the next month, except to the extent\r\nexpressly stated on the Site. The conditions under which unused\r\nConnects will rollover to the next month may vary from time to time\r\nand will depend on your membership program. </font></font></font>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in;">\r\n<br>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in;">\r\n<font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt">Shaikh\r\nCorp. reserves the right to change our membership programs,\r\nincluding, but not limited to, to change membership fees, change the\r\nmonthly number of Connects included in the membership programs,\r\nchange the price for additional Connects, and institute new fees at\r\nany time, upon reasonable notice posted in advance on the Site. No\r\nrefunds of fees already paid will be given. If Shaikh Corp. exercises\r\nour right to cancel a membership at any time, Shaikh Corp. will not\r\nrefund the membership fee already paid. </font></font></font>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in;">\r\n<br>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in;"><font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt"><b>Automatic\r\nMembership Renewal </b></font></font></font>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in;">\r\n<br>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in"><font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt">You\r\nmust pay your Freelancer membership fees through your Freelancer\r\nEscrow Account as described in the </font></font></font><font color="#0000ff"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt"><u>Account\r\nAgreement</u></font></font></font><font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt">.\r\nThe membership billing period begins on the date that Shaikh Corp.\r\nreceives payment. Freelancer membership fees are calculated from the\r\nbeginning of that billing period. </font></font></font>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in;">\r\n<br>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in"><font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt">Shaikh\r\nCorp. automatically renews your Freelancer monthly membership, and\r\nyou irrevocably authorize and instruct Softral to make the required\r\nmonthly payments to Shaikh Corp. on your behalf as described in the\r\n</font></font></font><font color="#0000ff"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt"><u>Account\r\nAgreement</u></font></font></font><font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt">.\r\nAutomatic renewal occurs on the first day after the expiration date\r\nof your membership.</font></font></font></p><p align="JUSTIFY" style="margin-bottom: 0in;">\r\n<font color="#000000"> </font>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in;"><font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt"><b>Changes\r\nto Membership Program </b></font></font></font>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in;">\r\n<br>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in;">\r\n<font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt">If\r\nyou upgrade your membership program, the unused portion of a lower\r\nmembership fee will be credited toward the higher membership fee. The\r\nnew billing period will then be based upon the date Shaikh Corp.\r\nreceives payment of the new membership fee. If you upgrade a\r\nmembership or add additional categories, it will result in a new\r\nbilling date, effective upon the date of payment of the additional\r\nfees and, if applicable, will result in a credit of the unused\r\nportion of the existing category membership fees. If you downgrade a\r\nmembership, you will not receive a refund or credit for the fees\r\nalready paid. The downgrade will go into effect at the beginning of\r\nthe next billing period. </font></font></font>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in;">\r\n<br>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in"><font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt">For\r\nmore information on upgrading, downgrading, or canceling your\r\nmembership, check the Site or contact </font></font></font><font color="#0000ff"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt"><u>Customer\r\nSupport</u></font></font></font><font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt">.\r\n</font></font></font>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in;">\r\n<br>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in;"><font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 11pt"><b>	2.\r\nSubmitting an Engagement Proposal </b></font></font></font>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in;">\r\n<br>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in;">\r\n<font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt">You\r\nagree to follow these guidelines when you submit a proposal for an\r\nEngagement: </font></font></font>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in;">\r\n<br>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0.13in"><font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt">	•\r\nProvide proposals only for Engagements that you are a good fit for\r\nand you can complete within Client’s time 	frames. </font></font></font>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0.13in;">\r\n<font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt">	•\r\nHelp Client clarify its needs and fully develop the Engagement scope\r\nand deliverables. </font></font></font>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0.13in;">\r\n<font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt">	•\r\nWrite a specific, detailed proposal with clear scope, deliverables,\r\nand milestones. </font></font></font>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0.13in;">\r\n<font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt">	•\r\nSet expectations that you can meet or exceed. </font></font></font>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0.13in;">\r\n<font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt">	•\r\nSpecify payment terms that tie to the completion of milestones. </font></font></font>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0.13in;">\r\n<font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt">	•\r\nSpecify how change orders will be handled. </font></font></font>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0.13in;">\r\n<font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt">	•\r\nSpecify how warranty work will be handled. </font></font></font>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0.13in;">\r\n<font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt">	•\r\nSubmit an accurate proposal reflecting your understanding of the\r\nscope of the Engagement and the amount of 	time/effort you plan to\r\ncommit in order to provide high Client satisfaction. </font></font></font>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0.13in;">\r\n<font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt">	•\r\nInform Client of your office hours and committed response time. </font></font></font>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0.13in;">\r\n<font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt">	•\r\nSubmit a new proposal when needed to reflect any changes to price,\r\ndelivery date, or approach prior to the end of 	the proposal period. </font></font></font>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0.13in;">\r\n<font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt">	•\r\nNot to submit unreasonably low proposal prices or test proposals. If\r\nyou wish to submit a proposal but require 	more information about the\r\nEngagement, post a message in the “Public Messages” area of the\r\nSite to request more 	information, indicating your assumptions\r\nregarding the Engagement scope in your proposal and making explicit\r\nthat 	you will update the proposal once you receive more information.\r\n</font></font></font>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0.13in;">\r\n<font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt">	•\r\nNot to submit proposals with the intent to commit fraud or violate\r\nthe Terms of Service. </font></font></font>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0.13in;">\r\n<font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt">	•\r\nNot to submit boilerplate, placeholder, or generic proposals. </font></font></font>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in;">\r\n<font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt">	•\r\nNot to offer your services in exchange for good feedback on the Site\r\nor for free. </font></font></font>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in;">\r\n<br>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in;"><font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 11pt"><b>	3.\r\nFulfilling an Engagement </b></font></font></font>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in;">\r\n<br>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in;">\r\n<font color="#000000"><font face="Arial, Arial, sans-serif">