"Arial, Arial, sans-serif"><font style="font-size: 9pt">\r\nfails to resolve your Dispute, this Policy provides the mechanism and\r\nterms to resolve the Dispute. This Policy does not cover feedback\r\nposted on the Site. If you have a complaint involving feedback,\r\nplease refer to the section titled “</font></font></font><font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt"><b>Feedback</b></font></font></font><font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt">”\r\nin the </font></font></font><font color="#0000ff"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt"><u>Site\r\nUsage Policy</u></font></font></font><font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt">.\r\nThis Policy does not cover Disputes relating to Hourly Engagements.\r\nIf you have a Dispute relating to an Hourly Engagement, please refer\r\nto the </font></font></font><font color="#0000ff"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt"><u>Refund\r\nand Cancellation Policy</u></font></font></font><font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt">\r\nand the </font></font></font><font color="#0000ff"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt"><u>Hourly\r\nDispute Resolution Policy</u></font></font></font><font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt">.\r\nIf you have entered into the </font></font></font><font color="#0000ff"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt"><u>Payroll\r\nServices Agreement</u></font></font></font><font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt">\r\nfor your Engagement, this Policy does not apply; please refer to the\r\nPayroll Services Agreement. Disputes with Shaikh Corp. are governed\r\nby the </font></font></font><font color="#0000ff"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt"><u>User\r\nAgreement</u></font></font></font><font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt">.</font></font></font></p><p align="JUSTIFY" style="margin-bottom: 0in;">\r\n<font color="#000000"> </font>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in;"><font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 11pt"><b>	1.\r\nDefinitions and Key Dates </b></font></font></font>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in;">\r\n<br>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in;">\r\n<font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt">For\r\nall Disputes, you must be aware of the following key dates and terms:\r\n</font></font></font>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in;">\r\n<br>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in"><font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt">	“</font></font></font><font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt"><b>Arbitration</b></font></font></font><font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt">”\r\nmeans binding non-appearance based arbitration by a neutral third\r\nparty as described in Section 5. </font></font></font>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in;">\r\n<br>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in"><font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt">	“</font></font></font><font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt"><b>Arbitration\r\nInvoice</b></font></font></font><font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt">”\r\nmeans an invoice delivered by Shaikh Corp. to Client or Freelancer\r\nfor its applicable portion of 	the costs of Arbitration as more\r\nparticularly described in Section 4 below. </font></font></font>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in;">\r\n<br>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in"><font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt">	“</font></font></font><font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt"><b>Arbitration\r\nLimitations Date</b></font></font></font><font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt">”\r\nmeans the date 30 days after the date a Dispute Notice Form is filed\r\nwith Shaikh 	Corp.. </font></font></font>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in;">\r\n<br>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in"><font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt">	“</font></font></font><font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt"><b>Breach\r\nDate</b></font></font></font><font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt">”\r\nfor a Fixed Price Engagement means the later of (1) the date on which\r\nthe events causing the 	Dispute with the other Member first took\r\nplace, or (2) the date on which you learned, or reasonably should\r\nhave 	learned, about the events causing the Dispute with the other\r\nMember; provided, however, that for a Dispute 	involving payments or\r\nthe delivery of a Deliverable for a Fixed Price Engagement, the\r\n“Breach Date” is the latter of: 	(a) the date of the Release of\r\nthe payment to which the Dispute relates, (b) the date payment was\r\ndue to be 	released for a delivered Deliverable, or (c) the date a\r\nDeliverable was due to be delivered. </font></font></font>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in;">\r\n<br>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in"><font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt">	“</font></font></font><font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt"><b>Dispute\r\nAssistance Deadline</b></font></font></font><font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt">”\r\nmeans the date 30 days after all funds are released and withdrawn\r\nfrom a Fixed 	Price Escrow Account, leaving it with $0. If an\r\nEngagement has more than one Milestone, then the Dispute 	Assistance\r\nDeadline will be calculated based on the most recent date that the\r\nFixed Price Escrow Account reached 	a balance of $0. </font></font></font>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in;">\r\n<br>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in"><font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt">	“</font></font></font><font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt"><b>Shaikh\r\nCorp. Dispute Assistance</b></font></font></font><font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt">”\r\nmeans the Dispute assistance provided by Shaikh Corp. as set forth in\r\nthis 	Policy. </font></font></font>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in;"><br>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in;"><font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 11pt"><b>	2.\r\nMember Resolution </b></font></font></font>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in;">\r\n<br>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in;">\r\n<font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt">Shaikh\r\nCorp. Dispute Assistance is only available (i) after initial funding\r\nof the Fixed Price Escrow Account associated with the Engagement and\r\n(ii) until the Dispute Assistance Deadline passes. After the Dispute\r\nAssistance Deadline passes, Shaikh Corp. Dispute Assistance is not\r\navailable to either Freelancer or Client via the Site. </font></font></font>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in;">\r\n<br>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in"><font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt">To\r\nresolve a Dispute for a Fixed Price Engagement, you must first submit\r\na Dispute Notice Form in the Workroom within 30 days of the Breach\r\nDate. If you are a Freelancer, Shaikh Corp. Dispute Assistance is\r\nonly available if the Fixed Price Escrow Account has a positive\r\nbalance at the time you file your Dispute. If you are a Client,\r\nShaikh Corp. Dispute Assistance is available through the Dispute\r\nAssistance Deadline. Filing a Dispute Notice Form begins the Member\r\nresolution process, and you are the “</font></font></font><font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt"><b>Initiating\r\nParty</b></font></font></font><font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt">.”\r\nIf you do not submit a Dispute Notice Form within 30 days of the\r\nBreach Date, Shaikh Corp. Dispute Assistance is no longer available\r\nto you.</font></font></font></p><p align="JUSTIFY" style="margin-bottom: 0in;">\r\n<br>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in;"><font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt"><b>Responding\r\nto a Dispute </b></font></font></font>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in;">\r\n<br>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in"><font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt">If\r\nan Initiating Party properly initiates a Dispute on the Site by\r\nfiling a Dispute Notice Form, the other Member (the “</font></font></font><font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt"><b>Opposing\r\nParty</b></font></font></font><font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt">”)\r\nhas two Business Days following the Initiating Party’s submission\r\nof the Dispute Notice Form to submit a Dispute Response. “</font></font></font><font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt"><b>Dispute\r\nResponse</b></font></font></font><font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt">”\r\nmeans: (1) if the Opposing Party is Client, that Client has not\r\nreceived all Deliverables required for a Release pursuant to the\r\nMember Contract, or (2) if the Opposing Party is Freelancer, that\r\nFreelancer has delivered all Deliverables required.</font></font></font></p><p align="JUSTIFY" style="margin-bottom: 0in;">\r\n<font color="#000000"> </font>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in;"><font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt"><b>Failure\r\nto Respond </b></font></font></font>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in;">\r\n<br>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in;">\r\n<font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt">If\r\nthe Opposing Party does not submit a Dispute Response to the Site\r\nwithin two Business Days following the Initiating Party’s\r\nsubmission of the Dispute Notice Form, Shaikh Corp. will then notify\r\nthe Opposing Party and request a response. If the Opposing Party does\r\nnot respond to Shaikh Corp. within three Business Days of Shaikh\r\nCorp.’s notification, then Client and Freelancer will be deemed to\r\nhave agreed to the remedy sought in the Dispute Notice Form. </font></font></font>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in;"><br>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in;"><font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 11pt"><b>	3.\r\nShaikh Corp. Dispute Assistance </b></font></font></font>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in;">\r\n<br>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in"><font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt">If\r\nShaikh Corp. receives a timely Dispute Notice Form and a Dispute\r\nResponse, Shaikh Corp. will provide notice to both parties (“</font></font></font><font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt"><b>Call\r\nNotice</b></font></font></font><font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt">”)\r\nto request that they mutually schedule a Dispute assistance call with\r\nan Shaikh Corp. facilitator (the “</font></font></font><font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt"><b>Facilitator</b></font></font></font><font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt">”)\r\nto encourage a settlement of the Dispute. The Call Notice will\r\nrequest a response within three Business Days of delivery of such\r\nCall Notice. The Facilitator will act solely as a neutral third party\r\nand will have no further obligations. The Facilitator will not judge\r\nthe Dispute and will not make any award. No Facilitator is authorized\r\nto make any recommendation or guaranty to the parties regarding the\r\nDispute or its outcome.</font></font></font></p><p align="JUSTIFY" style="margin-bottom: 0in;">\r\n<font color="#000000"> </font>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in;"><font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt"><b>One\r\nParty Does Not Respond to the Call Notice </b></font></font></font>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in;">\r\n<br>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in;">\r\n<font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt">If\r\none party responds to the Call Notice within three Business Days of\r\ndelivery of such Call Notice, but the other does not, Shaikh Corp.\r\nwill give the non-responding party an opportunity to request\r\nArbitration by sending the non-responding party an invoice for its\r\nshare of the Arbitration costs (described below). Shaikh Corp. will\r\nprovide the non-responding party two Business Days to pay the\r\ninvoice. If the invoice is not paid, Freelancer and Client will be\r\ndeemed to have irrevocably authorized and instructed Softral to, and\r\nSoftral will, Release the disputed funds to the party that did\r\nrespond to the Call Notice, to the extent that any disputed funds\r\nremain in the Escrow Account. If no funds remain in the Escrow\r\nAccount, Shaikh Corp. will close the Dispute. </font></font></font>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in;"><br>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in;"><font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt"><b>Neither\r\nParty Responds to the Call Notice </b></font></font></font>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in;">\r\n<br>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in;">\r\n<font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt">If\r\nneither party responds to the Call Notice within three Business Days\r\nof delivery of such Call Notice, Shaikh Corp. will provide both\r\nparties with the option to begin the Arbitration process on or before\r\nthe Arbitration Limitations Date to start the Arbitration process. If\r\nneither party initiates Arbitration by the Arbitration Limitations\r\nDate, then Client and Freelancer will be deemed to have authorized\r\nand instructed Softral to, and Softral will, Release the disputed\r\nfunds to Client, to the extent that any disputed funds remain in the\r\nEscrow Account. If no funds remain in the Escrow Account, Shaikh\r\nCorp. will close the Dispute. </font></font></font>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in;"><br>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in;"><font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt"><b>A\r\nCall Cannot Be Scheduled </b></font></font></font>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in;">\r\n<br>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in;">\r\n<font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt">Occasionally,\r\nbecause of time zone differences or other availability issues, a\r\nDispute assistance call cannot be scheduled at a suitable time for\r\neveryone involved. When that occurs, Shaikh Corp. will notify both\r\nparties that either may request Arbitration on or before the\r\nArbitration Limitations Date. </font></font></font>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in;"><br>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in;"><font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt"><b>One\r\nParty Elects to Bypass the Dispute Call and Proceed Directly to\r\nArbitration </b></font></font></font>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in;">\r\n<br>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in;">\r\n<font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt">If\r\neither party elects to bypass the Dispute assistance call and proceed\r\nto Arbitration after receiving a Call Notice, Shaikh Corp. will\r\ninvoice that party for its portion of the Arbitration fee (see\r\nbelow). If the requesting party does not pay the invoice within two\r\nBusiness Days of delivery of such invoice, then Shaikh Corp. will\r\nsend that party a reminder and notify it that it must pay the invoice\r\non or before the Arbitration Limitations Date. </font></font></font>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in;">\r\n<br>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in;">\r\n<font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt">If\r\nthe party requesting Arbitration is Freelancer, and there are no\r\nfunds in the Fixed Price Escrow Account, Arbitration is not\r\navailable. If there are funds available in the Fixed Price Escrow\r\nAccount and Freelancer does not initiate the Arbitration on or before\r\nthe Arbitration Limitations Date, Shaikh Corp. will remove the unpaid\r\ninvoice from Freelancer’s Account and close the Dispute. In that\r\ncase, Client and Freelancer will be deemed to have irrevocably\r\nauthorized and instructed Softral to, and Softral will, Release the\r\ndisputed funds to Client, to the extent that any disputed funds\r\nremain in the Escrow Account. </font></font></font>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in;">\r\n<font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt">If\r\nthe party requesting Arbitration is Client, and Client does not\r\ninitiate Arbitration on or before the Arbitration Limitations Date,\r\nShaikh Corp. will notify Freelancer five days before the Arbitration\r\nLimitations Date and provide Freelancer the option to initiate\r\nArbitration by paying Freelancer’s portion of the Arbitration costs\r\non or before the Arbitration Limitations Date. If Freelancer does not\r\ninitiate the Arbitration as required, then Client and Freelancer will\r\nbe deemed to have irrevocably authorized and instructed Softral to,\r\nand Softral will, Release the disputed funds to Client, to the extent\r\nthat any disputed funds remain in the Escrow Account. If no funds\r\nremain in the Escrow Account, Shaikh Corp. will close the Dispute.</font></font></font></p><p align="JUSTIFY" style="margin-bottom: 0in;">\r\n<font color="#000000"> </font>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in;"><font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt"><b>Dispute\r\nAssistance Call Scheduled; One or Both of the Parties Does Not Attend\r\n</b></font></font></font>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in;">\r\n<br>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in"><font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt">If\r\na Dispute assistance call is scheduled and one party attends (the\r\n“</font></font></font><font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt"><b>Attending\r\nParty</b></font></font></font><font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt">”)\r\nbut the other party does not give prior notice to Shaikh Corp. of\r\nnon-attendance and fails to attend (the “</font></font></font><font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt"><b>Non-Attending\r\nParty</b></font></font></font><font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt">”)\r\nthe scheduled call, then Shaikh Corp. Dispute Assistance is no longer\r\navailable. In that case, Shaikh Corp. will deliver an Arbitration\r\ninvoice to the Non-Attending Party and notify the Non-Attending Party\r\nthat it has two Business Days to pay the Arbitration invoice in order\r\nto initiate Arbitration (“</font></font></font><font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt"><b>Non-Attendance\r\nNotice</b></font></font></font><font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt">”).\r\nIf the Non-Attending Party does not pay the Arbitration invoice\r\nwithin two Business Days of the date of the Non-Attendance Notice,\r\nthen Client and Freelancer will be deemed to have irrevocably\r\nauthorized and instructed Softral to, and Softral will, make the\r\nRelease sought by the Attending Party, if any funds remain in the\r\nEscrow Account. If no funds remain in the Escrow Account, Shaikh\r\nCorp. will close the Dispute.</font></font></font></p><p align="JUSTIFY" style="margin-bottom: 0in;">\r\n<font color="#000000"> </font>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in"><font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt">If\r\na Dispute assistance call is scheduled and both parties do not give\r\nprior notice to Shaikh Corp. of non-attendance and both do not\r\nparticipate in the call, Shaikh Corp. will notify both parties that\r\nthey have until the Arbitration Limitations Date to demand\r\nArbitration via the Site in accordance with Section 5 titled\r\n“</font></font></font><font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt"><b>Arbitration\r\nfor Fixed Price Engagements</b></font></font></font><font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt">”\r\nbelow. If neither party demands Arbitration on or before the\r\nArbitration Limitations Date, then Client and Freelancer will be\r\ndeemed to have irrevocably authorized and instructed Softral to, and\r\nSoftral will, Release the disputed funds to Client, to the extent\r\nthat any disputed funds remain in the Escrow Account. If no funds\r\nremain in the Escrow Account, Shaikh Corp. will close the Dispute. </font></font></font>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in;"><br>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in;"><font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt"><b>Dispute\r\nAssistance Call Held; Parties Attend but Fail to Reach Agreement or\r\nthey agree to Arbitration </b></font></font></font>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in;">\r\n<font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt">If\r\nthe parties agree to Arbitration during or as a result of the Dispute\r\nassistance call, or if one of the parties to the call notifies Shaikh\r\nCorp. that it will pursue Arbitration, then Shaikh Corp. will deliver\r\ninstructions to both parties regarding the process for initiating\r\nArbitration. At the point that Shaikh Corp. send the parties an\r\nArbitration invoice, the parties will each have two Business Days to\r\npay the Arbitration invoice in order to initiate Arbitration. At that\r\npoint, the process differs depending whether funds are held in the\r\nFixed Price Escrow Account or not. </font></font></font>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in;"><br>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in;"><font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt"><b>	If\r\nFunds are Held in Escrow </b></font></font></font>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in;">\r\n<font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt">	If\r\nfunds are held in the Fixed Price Escrow Account and neither party\r\npays the Arbitration invoice, then Shaikh Corp. 	will deliver notice\r\nto both non-paying parties that if they do not pay the Arbitration\r\ninvoice within five Business Days 	after delivery of such notice, the\r\nfunds in the Fixed Price Escrow Account will be released to Client.</font></font></font></p><p align="JUSTIFY" style="margin-bottom: 0in;">\r\n<font color="#000000"> </font>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in;">\r\n<font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt">	If\r\none party pays the Arbitration invoice (including after initial\r\nnotice of non-payment), then Shaikh Corp. will deliver 	notice to the\r\nnon-paying party that if they do not pay the Arbitration invoice\r\nwithin five Business Days after delivery 	of such notice, the funds\r\nin the Fixed Price Escrow Account will be released to the paying\r\nparty. </font></font></font>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in;">\r\n<br>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in;">\r\n<font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt">	If\r\nboth parties pay the Arbitration invoice (including after initial\r\nnotice of non-payment), then Shaikh Corp. will deliver 	instructions\r\nfor initiating Arbitration. </font></font></font>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in;">\r\n<br>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in;"><font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt"><b>	If\r\nNo Funds are Held in Escrow </b></font></font></font>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in;">\r\n<font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt">	If\r\nno funds are held in the Fixed Price Escrow Account, Shaikh Corp.\r\nwill notify both parties that Client has the right 	to proceed to\r\nArbitration and at that time Shaikh Corp. will deliver an Arbitration\r\ninvoice to Client. If Client does not 	pay the Arbitration invoice\r\nwithin two Business Days of delivery of such invoice, Shaikh Corp.\r\nwill notify Client of the 	Arbitration Limitations Date. If Client\r\ndoes not initiate Arbitration by the Arbitration Limitations Date,\r\nShaikh Corp. will 	close the Dispute. </font></font></font>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in;"><br>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in;"><font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 11pt"><b>	4.\r\nIf Parties Reach Agreement </b></font></font></font>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in;">\r\n<br>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in;">\r\n<font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt">Any\r\nagreement resolving a Dispute must be posted and confirmed by both\r\nparties in their Workroom. </font></font></font>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in;"><br>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in;"><font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 11pt"><b>	5.\r\nArbitration for a Fixed Price Engagement </b></font></font></font>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in;">\r\n<br>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in"><font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt">By\r\nusing the Site, you agree that each party to a Member Contract has\r\nthe right to demand Arbitration of a Fixed Price Engagement if the\r\nFixed Price Escrow associated with the Engagement has been funded at\r\nleast once and (i) if the party is the Freelancer, the Fixed Price\r\nEscrow has funds remaining in it and Freelancer requests Arbitration\r\nbefore the Arbitrations Limitation Date, or (ii) if the party is the\r\nClient, Client requests Arbitration before the Arbitration\r\nLimitations Date. If either Client or Freelancer demands Arbitration\r\nin accordance with this Policy and you are not the party that\r\nrequested Arbitration, you agree to submit to the Arbitration and pay\r\nyour share of the Arbitration fees detailed below. In any\r\nArbitration, each of you and the other Member is a “</font></font></font><font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt"><b>Dispute\r\nParty</b></font></font></font><font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt">,”\r\nand collectively you are the “</font></font></font><font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt"><b>Dispute\r\nParties</b></font></font></font><font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt">.”\r\n</font></font></font>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in;">\r\n<br>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in"><font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt">Any\r\nsuch Arbitration will be conducted by a neutral third-party\r\nArbitration services: the </font></font></font><font color="#0000ff"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt"><u>American\r\nArbitration Association</u></font></font></font><font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt">\r\n(“</font></font></font><font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt"><b>AAA</b></font></font></font><font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt">”).\r\nThe Arbitration rules and fees for each are set out in Appendix A\r\n(for the AAA) to this Policy. By default, Arbitration will be\r\nconducted by AAA unless Shaikh Corp. chooses another Arbitration\r\nservice. </font></font></font>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in;">\r\n<br>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in;"><font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt"><b>Filing\r\nthe Case with the Arbitrator</b></font></font></font></p><p align="JUSTIFY" style="margin-bottom: 0in;"><font color="#000000">\r\n</font><br>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in"><font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt">When\r\na Member (the “</font></font></font><font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt"><b>Arbitration\r\nPlaintiff</b></font></font></font><font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt">”)\r\ndemands Arbitration, or when the circumstances dictate that Shaikh\r\nCorp. notify that Member of its right to file for Arbitration as\r\ndescribed above, Shaikh Corp. will provide that Member with\r\ninstructions on initiating the Arbitration. Shaikh Corp. subsequently\r\nwill invoice the Arbitration Plaintiff for that party’s portion of\r\nthe applicable Arbitration fees. If the Arbitration Plaintiff does\r\nnot pay the invoice within three Business Days, then Shaikh Corp.\r\nwill send the Arbitration Plaintiff a reminder to pay the invoice. If\r\nthe Arbitration Plaintiff does not pay the invoice within the\r\nrequired time, then the Dispute will be closed and Arbitration will\r\nno longer be available to the Arbitration Plaintiff. </font></font></font>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in;">\r\n<br>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in"><font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt">If\r\nthe Arbitration Plaintiff pays the invoice, Shaikh Corp. will contact\r\nthe other party (“</font></font></font><font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt"><b>Arbitration\r\nRespondent</b></font></font></font><font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt">”)\r\nto request that the Arbitration Respondent pay its portion of the\r\nArbitration fees as well. If the Arbitration Respondent fails to\r\nsubmit to such Arbitration within five calendar days after the First\r\nArbitration Notice, Shaikh Corp. will suspend the Arbitration\r\nRespondent’s Account and send the Arbitration Respondent a notice\r\nthat it must pay the Arbitration fees. If the Arbitration Respondent\r\ndoes not pay its portion of the Arbitration fees within 15 calendar\r\ndays of the date of the First Arbitration Notice, then both parties\r\nwill be deemed to have irrevocably authorized and instructed Softral\r\nto, and Softral will, Release the funds sought by the Arbitration\r\nPlaintiff in the demand for Arbitration, to the extent such funds\r\nremain in the Fixed Price Escrow Account. If no funds remain in the\r\nFixed Price Escrow Account, Shaikh Corp. will close the Dispute. </font></font></font>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in;">\r\n<br>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in;">\r\n<font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt">If\r\nboth parties pay their portion of the Arbitration fees, Shaikh Corp.\r\nwill instruct the parties on the process for initiating the\r\nArbitration with the Arbitration service provider. After the parties\r\nhave initiated the Arbitration, Shaikh Corp. will provide the\r\narbitrator with the Dispute Notice Form, the Dispute Response, and\r\naccess to the Workroom and its contents.</font></font></font></p><p align="JUSTIFY" style="margin-bottom: 0in;">\r\n<font color="#000000"> </font>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in;">\r\n<font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt">If\r\nArbitration registration is completed by one party and the other\r\nparty fails to complete Arbitration registration within 15 days, the\r\nparty that failed to register will be deemed to have authorized and\r\ninstructed Shaikh Corp. to, and Shaikh Corp. will, Release the\r\ndisputed funds to registered party, to the extent that any disputed\r\nfunds remain in the Escrow Account. </font></font></font>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in;">\r\n<br>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in;"><font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt"><b>Authorization\r\nto Collect Arbitration Fees </b></font></font></font>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in;">\r\n<br>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in;">\r\n<font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt">When\r\nyou electronically authorize to pay the invoice sent to you by Shaikh\r\nCorp. for your portion of Arbitration fees via the Site, you\r\nirrevocably authorize and instruct (i) Softral and its wholly owned\r\nsubsidiaries, as your agent, to charge your Payment Method for the\r\namount of the payment for credit to your Escrow Account; and (ii)\r\nSoftral, as escrow agent, to immediately release that amount from\r\nyour Escrow Account and pay it to Shaikh Corp.. If Softral or its\r\nwholly owned subsidiaries cannot collect sufficient funds to fulfill\r\nthe Escrow for any reason, Softral has no obligation with respect to\r\nmaking the payment to Shaikh Corp. on your behalf, and you will be\r\nconsidered as not having paid your portion of the Arbitration fees as\r\nrequired by this Policy. </font></font></font>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in;"><br>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in;"><font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt"><b>Limitations\r\nPeriod for Arbitrations </b></font></font></font>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in;">\r\n<br>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in;">\r\n<font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt">If\r\nboth Freelancer and Client fail to demand binding Arbitration for an\r\nunresolved Dispute by the Arbitration Limitations Date, then Client\r\nand Freelancer will be deemed to have irrevocably authorized and\r\ninstructed Softral to, and Softral will, Release all funds in the\r\nFixed Price Escrow Account to Client. </font></font></font>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in;"><br>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in;"><font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt"><b>Arbitration\r\nAward </b></font></font></font>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in;">\r\n<br>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in;">\r\n<font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt">You\r\nagree that the arbitrator is authorized to decide the Dispute within\r\nits discretion. You agree that the arbitrator’s award is final,\r\nthat it may be entered in and enforced by any court of competent\r\njurisdiction, and that if the arbitrator delivers notice of any award\r\nto Shaikh Corp., then Shaikh Corp. and Softral have the right to\r\ntreat such notice as conclusive and act in reliance thereon. </font></font></font>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in;"><br>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in;"><font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt"><b>Fees\r\nfor Escrow Releases Following Dispute Resolution </b></font></font></font>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in;">\r\n<br>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in;">\r\n<font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt">All\r\nEscrow Releases under this Policy are subject to the normal Service\r\nFees associated with Escrow Accounts, as detailed in the Account\r\nAgreement and applicable Escrow Instructions. </font></font></font>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in;"><br>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in;"><font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 11pt"><b>	6.\r\nNotices </b></font></font></font>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in;">\r\n<br>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in;">\r\n<font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt">Dispute\r\nNotice Forms, Dispute Responses, and notification of the closing of a\r\nDispute will be posted in the Workroom. All other notices to a Member\r\nrequired by this Policy will be via email sent by Shaikh Corp. to the\r\nMember’s registered email address. Members are solely responsible\r\nfor maintaining a current, active email address registered with\r\nShaikh Corp., for checking their email, and for responding to notices\r\nsent by Shaikh Corp. to the Member’s registered email address. </font></font></font>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in;"><br>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in;"><font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 11pt"><b>	7.\r\nFailure to Comply with this Policy </b></font></font></font>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in;"><br>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in;"><font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt"><b>Improperly\r\nFiled Claims </b></font></font></font>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in;">\r\n<br>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in"><font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt">All\r\nclaims, disputes, and other disagreements between you and another\r\nMember that are covered by this Policy must be resolved in accordance\r\nwith the terms in this Policy. This Policy incorporates all terms,\r\nconditions, rules, policies, and guidelines on the Site, including\r\nthe provisions relating to chargebacks contained in the other </font></font></font><font color="#0000ff"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt"><u>Terms\r\nof Service</u></font></font></font><font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt">.\r\nAll claims filed or brought contrary to this Policy will be\r\nconsidered improperly filed, and Shaikh Corp. will have the right to\r\ntake any other action, including suspension or cancellation of your\r\nAccount, and any other legal action as Shaikh Corp. deems appropriate\r\nin our sole discretion. Should you file a claim contrary to this\r\nPolicy, the other Member may recover attorneys’ fees and costs up\r\nto $2,000, provided that the other Member has notified you in writing\r\nof the improperly filed claim, and you fail to promptly withdraw the\r\nclaim. </font></font></font>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in;"><br>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in;"><font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 11pt"><b>	8.\r\nAbuse </b></font></font></font>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in;">\r\n<br>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in;">\r\n<font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt">Shaikh\r\nCorp., in our sole discretion, reserves the right to suspend or\r\ncancel your Account immediately upon giving notice to you if Shaikh\r\nCorp. believes you may be abusing this Policy or as otherwise\r\npermitted by the other Terms of Service. However, any Disputes for\r\nany Engagements that existed prior to cancellation will be subject to\r\nthe Terms of Service. </font></font></font>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in;"><br>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in;"><font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 11pt"><b>	9.\r\nContacting Us </b></font></font></font>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in;">\r\n<br>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in;">\r\n<font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt">If\r\nyou wish report a violation of the Terms of Service, have any\r\nquestions, or need assistance, please contact Customer Support at: </font></font></font>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in;">\r\n<br>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in"><font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt"><b>Web\r\nSupport: </b></font></font></font><font color="#0000ff"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt"><u>http://www.softral.com/help</u></font></font></font><font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt">\r\n</font></font></font>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in"><font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt"><b>Email:\r\n</b></font></font></font><font color="#0000ff"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt"><u>admin@softral.com</u></font></font></font><font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt">\r\n</font></font></font>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in"><font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt"><b>Phone:\r\n</b></font></font></font><font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt">1-251-366-0801\r\n</font></font></font>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in;">\r\n<font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt">(Monday\r\n12:01 AM through Friday 12:00 AM Midnight Central Time) </font></font></font>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in"><font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt"><b>Online\r\nHelp Topics: </b></font></font></font><font color="#0000ff"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt"><u>http://www.softral.com/help</u></font></font></font><font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt">\r\n</font></font></font>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in;">\r\n<br>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in;">\r\n<br>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in;"><font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt"><b>APPENDIX\r\nA </b></font></font></font>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in;"><br>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in;"><font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt"><b>RULES\r\nAND FEES FOR ARBITRATIONS CONDUCTED BY THE AMERICAN ARBITRATION\r\nASSOCIATION </b></font></font></font>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in;"><br>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in;"><font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt"><b>This\r\nAppendix A Summarizes Certain Pertinent Contractual Terms That\r\nAmerican Arbitration Association (AAA) Has Agreed To In Providing\r\nArbitration Services To Clients And Freelancers Who Choose AAA As\r\nTheir Arbitrator. AAA Is Solely A Third-Party Service Provider.\r\nShaikh Corp. And Our Affiliates Have No Direct Or Indirect Affiliate,\r\nPartnership, Joint Venture, Ownership Or Control Relationship With Or\r\nInterest In AAA. Shaikh Corp. And Our Affiliates Assume No\r\nResponsibility Or Liability For The Services Of AAA. </b></font></font></font>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in;"><br>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in;"><font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt"><b>Appointment\r\nof the Arbitrator </b></font></font></font>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in;">\r\n<br>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in;">\r\n<font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt">All\r\nArbitrations by the AAA are conducted by a single arbitrator. </font></font></font>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in;">\r\n<br>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in;">\r\n<font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt">The\r\nAAA will provide the parties the opportunity to participate in\r\narbitrator selection through a strike-and-rank process of\r\npre-qualified arbitrators. </font></font></font>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in;">\r\n<br>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in;">\r\n<font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt">	1.\r\nEach party will be provided with an identical list of five potential\r\narbitrators and may have up to three calendar 	days to strike two\r\npotential arbitrators and rank the remaining in order of preference.\r\nIf any party does not return the 	list within five calendar days, all\r\npersons named therein will be deemed acceptable. </font></font></font>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in;">\r\n<br>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in;">\r\n<font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt">	2.\r\nFrom among the arbitrators approved on both lists and in accordance\r\nwith the designated order of mutual 	preference, the AAA will invite\r\nthe arbitrator to serve. If for any reason the appointment cannot be\r\nmade according to 	this procedure, the AAA will have the power to\r\nmake the appointment without submission of additional lists. </font></font></font>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in;">\r\n<br>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in;">\r\n<font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt">	3.\r\nAny arbitrator will be impartial and independent and will perform his\r\nor her duties with diligence and in good faith, 	and will be subject\r\nto disqualification for any grounds provided by applicable law. </font></font></font>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in;">\r\n<br>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in;">\r\n<font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt">	4.\r\nNeither Shaikh Corp. nor any party or party representative will\r\ncommunicate ex parte with an arbitrator or 	candidate for arbitrator\r\nconcerning the Arbitration. Notwithstanding the above, Shaikh Corp.\r\nand an arbitrator may 	communicate ex 	parte solely for the purpose\r\nof enabling the arbitrator to access and use the Site and/or the\r\n	Workroom associated with the Engagement in Dispute. </font></font></font>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in;"><br>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in;"><font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt"><b>Rules\r\nof the Proceedings </b></font></font></font>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in;">\r\n<br>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in;">\r\n<font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt">	1.\r\nThe amount at issue in any claims or counterclaims relating to an\r\nEngagement will be limited to the sum still held 	in Escrow and the\r\nsum previously released from Escrow for the Engagement. </font></font></font>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in;">\r\n<br>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in"><font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt">	2.\r\nThe Arbitration Plaintiff may submit a statement of the case\r\n(“</font></font></font><font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt"><b>Initial\r\nStatement</b></font></font></font><font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt">”),\r\nnot to exceed 1,500 words, 	within three Business Days of being\r\nnotified that the case has been filed with the AAA. The Arbitration\r\nPlaintiff will 	post the Initial Statement to the Workroom. </font></font></font>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in;">\r\n<font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt">	</font></font></font></p><p align="JUSTIFY" style="margin-bottom: 0in"><font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt">	3.\r\nThe Arbitration Respondent may submit a response (“</font></font></font><font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt"><b>Response\r\nStatement</b></font></font></font><font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt">”),\r\nnot to exceed 1,500 words, within 	three Business Days of receiving\r\nthe Initial Statement. The Arbitration Respondent will post the\r\nResponse 	Statement to the Workroom. </font></font></font>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in;">\r\n<br>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in;">\r\n<font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt">	4.\r\nEither party may elect to use their Dispute Notice Form or Dispute\r\nResponse (as applicable) in lieu of creating a 	separate Initial\r\nStatement or Response Statement for the Arbitration. No party may\r\nsubmit new or different claims 	after the case has been initiated. </font></font></font>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in;">\r\n<br>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in;">\r\n<font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt">	5.\r\nAll proceedings will be “on documents” and the evidence\r\nadmissible will consist solely and exclusively of 	Workroom contents\r\nat the time the Dispute was submitted to the Shaikh Corp. Dispute\r\nresolution process. Any 	communication taking place outside the\r\nWorkroom must have been posted to the Workroom within 24 hours of the\r\n	original transmission of that communication in order to be\r\nadmissible. Once Arbitration is initiated, the arbitrator can 	make\r\nan award based solely on the Workroom contents and material submitted\r\nto initiate the Arbitration. The failure 	of one party or the other\r\nto respond to an arbitrator request or otherwise continue to\r\nparticipate in the Arbitration will 	not prevent the arbitrator from\r\nmaking an award. </font></font></font>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in;">\r\n<br>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in;">\r\n<font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt">	6.\r\nThe language of the Arbitration will be English. </font></font></font>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in;">\r\n<br>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in"><font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt">	7.\r\nAt the arbitrator’s sole discretion, the arbitrator may permit or\r\nrequire the submission of additional written 	statements from the\r\nparties (“</font></font></font><font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt"><b>Additional\r\nArguments</b></font></font></font><font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt">”).\r\nThe arbitrator is not required to permit Additional Arguments. 	If\r\nthe arbitrator permits Additional Arguments, the arbitrator will\r\nestablish the schedule and rules for the submission 	of such\r\nAdditional Arguments, including any limits on the length of such\r\nAdditional Arguments. </font></font></font>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in;">\r\n<br>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in;">\r\n<font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt">	8.\r\nThe Arbitration will conclude within 30 calendar days from the date\r\nof submission to the AAA, and the arbitrator 	may grant an extension\r\nfor good cause not to exceed 14 calendar days. </font></font></font>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in;">\r\n<br>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in;">\r\n<font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt">	9.\r\nCommunications by either party to the arbitrator will be shared with\r\nall parties. </font></font></font>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in;">\r\n<br>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in;">\r\n<font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt">	10.\r\nAll awards will be final, non-appealable and enforceable by any court\r\nof competent jurisdiction. </font></font></font>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in;">\r\n<br>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in;">\r\n<font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt">	11.\r\nNeither the AAA nor any arbitrator in a proceeding under these rules\r\nand procedures is a necessary or proper 	party in judicial\r\nproceedings relating to the Arbitration. The parties to an\r\nArbitration under these rules and 	procedures will be deemed to have\r\nconsented that neither the AAA nor any arbitrator will be liable to\r\nany party in 	any action for damages or injunctive relief for any act\r\nor omission in connection with any Arbitration under these 	rules and\r\nprocedures. </font></font></font>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in;"><br>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in;"><font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt"><b>The\r\nAward </b></font></font></font>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in;">\r\n<br>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in;">\r\n<font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt">The\r\nAAA will provide Shaikh Corp. and the parties with a written award\r\npromptly upon the conclusion of the Arbitration, and in no event\r\nlater than 14 calendar days after conclusion of the Arbitration. At\r\nthe arbitrator’s sole discretion, the arbitrator may provide, but\r\nis not required to provide, written reasons for the Award to the\r\nparties. </font></font></font>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in;"><br>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in;"><font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt"><b>Fees\r\n</b></font></font></font>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in;">\r\n<br>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in;">\r\n<font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt">The\r\nfee for Arbitrations by the AAA is $875, regardless of the amount at\r\nissue. </font></font></font>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in;">\r\n<br>\r\n</p><p align="JUSTIFY" style="margin-bottom: 0in;">\r\n<font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt">Each\r\nof the Dispute Parties and Shaikh Corp. will share the cost equally\r\n($291 each). </font></font></font>\r\n</p><p a