></font><font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt">\r\nor in the other Terms of Service or have the meanings given such\r\nterms on the Site.</font></font></font></p><p style="margin-bottom: 0in;">\r\n<font color="#000000"> </font>\r\n</p><p style="margin-bottom: 0in;"><font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 11pt"><b>	1.\r\nPosting an Engagement </b></font></font></font>\r\n</p><p style="margin-bottom: 0in;">\r\n<br>\r\n</p><p style="margin-bottom: 0in;">\r\n<font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt">As\r\na Client, when posting Engagements and engaging Freelancers, you\r\nagree to abide by the following guidelines:</font></font></font></p><p style="margin-bottom: 0in;">\r\n<font color="#000000"> </font>\r\n</p><p style="margin-bottom: 0.13in"><font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt">	•\r\nPost Engagements with clear scope, well-defined deliverables, and\r\nrequired time frames. Do not hesitate to 	contact </font></font></font><font color="#0000ff"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt"><u>Customer\r\nSupport</u></font></font></font><font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt">\r\nfor assistance with posting an Engagement. </font></font></font>\r\n</p><p style="margin-bottom: 0.13in"><font color="#000000"><font face="Georgia, Georgia, serif"><font style="font-size: 9pt">	•\r\n</font></font></font><font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt">Answer\r\nclarifying questions from Freelancers and update the Engagement\r\ndescription. </font></font></font>\r\n</p><p style="margin-bottom: 0.13in;">\r\n<font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt">	•\r\nAccept an Engagement proposal only when it has a clear description of\r\nthe Freelancer Services, well-defined 	deliverables and milestones,\r\nprecise timeframes, and payment terms. </font></font></font>\r\n</p><p style="margin-bottom: 0.13in;">\r\n<font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt">	•\r\nEvaluate multiple Engagement proposals against criteria important to\r\nyou, such as a Freelancer’s experience, 	education, portfolio,\r\ncertifications, references, feedback from prior Clients, location,\r\ncommunication style, and cost. </font></font></font>\r\n</p><p style="margin-bottom: 0.13in;">\r\n<font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt">	•\r\nAsk Freelancer to utilize the Engagement Terms feature on the Site to\r\ndefine key milestones and payment 	schedules. </font></font></font>\r\n</p><p style="margin-bottom: 0.13in;">\r\n<font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt">	•\r\nAsk for Freelancer’s office hours and standard response times. </font></font></font>\r\n</p><p style="margin-bottom: 0in"><font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt">	•\r\nOnce you have engaged a Freelancer for an Engagement, log into the\r\nSite to manage the Engagement and use 	the Workroom as described in\r\nthe section titled “</font></font></font><font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt"><b>Communication</b></font></font></font><font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt">.”\r\n</font></font></font>\r\n</p><p style="margin-bottom: 0in;">\r\n<br>\r\n</p><p style="margin-bottom: 0in;"><font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 11pt"><b>	2.\r\nProhibited Engagement Postings </b></font></font></font>\r\n</p><p style="margin-bottom: 0in;">\r\n<br>\r\n</p><p style="margin-bottom: 0in;">\r\n<font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt">You\r\nagree NOT to do the following when you post an Engagement or transmit\r\ninformation on the Site: </font></font></font>\r\n</p><p style="margin-bottom: 0.13in;">\r\n<br><br>\r\n</p><p style="margin-bottom: 0.13in;">\r\n<font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt">	•\r\nPost any Engagement, submit any Engagement proposal, or otherwise use\r\nthe Site to transmit any content or 	conduct any transaction that\r\nwould violate any applicable law or regulation. </font></font></font>\r\n</p><p style="margin-bottom: 0.13in;">\r\n<font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt">	•\r\nPost any Engagement that is fake, posted without the intention to\r\nengage or complete the Engagement, or posted 	only to receive pricing\r\ninformation. </font></font></font>\r\n</p><p style="margin-bottom: 0.13in;">\r\n<font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt">	•\r\nPost any Engagement that offers commission or equity compensation. </font></font></font>\r\n</p><p style="margin-bottom: 0.13in;">\r\n<font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt">	•\r\nPost any Engagement that requests free services. </font></font></font>\r\n</p><p style="margin-bottom: 0.13in;">\r\n<font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt">	•\r\nRequire or request that Freelancer to deliver a free mock-up or proof\r\nof concept as part of an Engagement 	proposal submission or as a\r\ncondition to consideration of an Engagement proposal. </font></font></font>\r\n</p><p style="margin-bottom: 0in;">\r\n<font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt">	•\r\nPost any Engagement, Engagement proposal, or deliverable or transmit\r\nany content that infringes a third party’s 	Intellectual Property\r\nRights, violates the terms and conditions of use of a third-party\r\nwebsite or copyrighted 	materials, or violates a third party’s\r\nrights of publicity or privacy. </font></font></font>\r\n</p><p style="margin-bottom: 0in;">\r\n<br>\r\n</p><p style="margin-bottom: 0.13in;">\r\n<font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt">	•\r\nPost any Engagement, Engagement proposal, or deliverable or transmit\r\nany content related to or containing any 	adult or sexually explicit\r\nmaterial. </font></font></font>\r\n</p><p style="margin-bottom: 0.13in;">\r\n<font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt">	•\r\nPost any Engagement related to bulk email or spam, including, but not\r\nlimited to, bulk email hosting, scripts, active 	code, programs,\r\nproxies, lists, and relay servers. </font></font></font>\r\n</p><p style="margin-bottom: 0in;">\r\n<font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt">	•\r\nPost any Engagement or submit any proposal that violates, or has the\r\npotential to violate, the integrity of academic 	and professional\r\napplications, tests and work, for example, by passing off the skills,\r\nideas, or words of another as 	one’s own; using another’s\r\nproduction or content without crediting the source; presenting as new\r\nand original, ideas 	or products derived from an existing source;\r\npresenting fabricated facts, persons, or sources as real. </font></font></font>\r\n</p><p style="margin-bottom: 0in;">\r\n<br>\r\n</p><p style="margin-bottom: 0in;"><font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 11pt"><b>	3.\r\nNon-Circumvention </b></font></font></font>\r\n</p><p style="margin-bottom: 0in;">\r\n<br>\r\n</p><p style="margin-bottom: 0in"><font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt">You\r\nacknowledge and agree that, pursuant to and for the reasons stated in\r\nthe </font></font></font><font color="#0000ff"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt"><u>User\r\nAgreement</u></font></font></font><font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt">,\r\nfor 24 months from the time you identify or are identified by any\r\nparty through the Site, you must use the Site as your exclusive\r\nmethod to request, make, and receive all payments for any services\r\ndirectly or indirectly provided to or received from that party or\r\narising out of your relationship with that party. You may opt-out of\r\nthis obligation only if Client, prospective Client, or Freelancer\r\npays Shaikh Corp. an Opt-Out Fee as detailed in the </font></font></font><font color="#0000ff"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt"><u>User\r\nAgreement</u></font></font></font><font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt">\r\nin the section titled “</font></font></font><font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt"><b>Non-Circumvention</b></font></font></font><font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt">.”\r\n</font></font></font>\r\n</p><p style="margin-bottom: 0in;">\r\n<br>\r\n</p><p style="margin-bottom: 0in;"><font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 11pt"><b>	4.\r\nAudit Provisions and Record Keeping </b></font></font></font>\r\n</p><p style="margin-bottom: 0in;">\r\n<br>\r\n</p><p style="margin-bottom: 0in;">\r\n<font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt">For\r\none year after paying for each Engagement, you agree to keep and\r\nmaintain complete and accurate records related to the Freelancer\r\nServices that you received from Freelancer, including the service\r\ndescription, the proposal and payment terms, and information on all\r\nrepeat or follow-on Freelancer Services received from each\r\nFreelancer. If questions arise regarding services rendered or fees\r\ndue, you agree to provide copies of these records and other relevant\r\ndocumentation to Shaikh Corp. within 5 days of Shaikh Corp.’s\r\nrequest. Additional record keeping requirements for Clients using\r\nShaikh Corp. Payroll Services are described in the Shaikh Corp.\r\nPayroll Services Agreement and the additional documents to which it\r\nrefers. </font></font></font>\r\n</p><p style="margin-bottom: 0in;"><br>\r\n</p><p style="margin-bottom: 0in;"><font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 11pt"><b>	5.\r\nContacting Us </b></font></font></font>\r\n</p><p style="margin-bottom: 0in;">\r\n<br>\r\n</p><p style="margin-bottom: 0in;">\r\n<font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt">If\r\nyou wish to report a violation of the Terms of Service, have any\r\nquestions, or need assistance, please contact Customer Support at: </font></font></font>\r\n</p><p style="margin-bottom: 0in;"><br>\r\n</p><p style="margin-bottom: 0in"><font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt"><b>Web\r\nSupport: </b></font></font></font><font color="#0000ff"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt"><u>http://www.softral.com/help</u></font></font></font></p><p style="margin-bottom: 0in"><font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt"><b>Email:\r\n</b></font></font></font><font color="#0000ff"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt"><u>admin@softral.com</u></font></font></font><font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt">\r\n</font></font></font>\r\n</p><p style="margin-bottom: 0in"><font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt"><b>Phone:\r\n</b></font></font></font><font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt">1-251-633-0801</font></font></font></p><p style="margin-bottom: 0in;">\r\n<font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt">(Monday\r\n12:01 AM through Friday 12:00 AM. Midnight Central Time) </font></font></font>\r\n</p><p style="margin-bottom: 0in">\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n<font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt">\r\n</font></font></font>\r\n</p><p style="margin-bottom: 0in"><font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt"><b>Online\r\nHelp Topics: </b></font></font></font><font color="#0000ff"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt"><u>http://www.softral.com/help</u></font></font></font><font color="#000000"><font face="Arial, Arial, sans-serif"><font style="font-size: 9pt">\r\n</font></font></font>\r\n</p>', '', '1', 4, 'links1');
