(17, 'Contact us Content area', '<address style="line-height: 20px; color: rgb(51, 51, 51); font-family: ''Helvetica Neue'', Helvetica, Arial, sans-serif;"><strong>Softral, Inc.</strong><br>795 Folsom Ave, Suite 600<br>San Francisco, CA 94107<br><abbr title="Phone">P:</abbr>&nbsp;(251) 633-0801</address><address style="line-height: 20px; color: rgb(51, 51, 51); font-family: ''Helvetica Neue'', Helvetica, Arial, sans-serif;"><strong>Full Name</strong><br><a href="mailto:#" style="color: rgb(119, 119, 119);">S</a>oftral&nbsp;</address>', '', '0', 3, 'contact-us-area'),
(18, 'Plans & Fees', '<p><span style="font-weight: bold;">Standard Plan:</span></p><p><span style="background-color: rgb(255, 0, 255);">Clients and Employers:</span></p><p>Free unlimited Job Posting</p><p>No transaction Fees</p><p><br></p><p><span style="background-color: rgb(255, 0, 255);">Freelancers:</span></p><p>$1.00 per transaction to Softral</p><p>Money Transfer Fees only</p><p>You can choose the money transfer method of your convenience</p><p>Payment by Check Fee; Free</p><p>Payment by Western Union: WU fee only</p><p>Skrill: Skrill fee only</p><p><br></p>', '', '1', 18, 'plans-fees'),
(19, 'Plans & Fees', '<p><span style="font-weight: bold;">Standard Plan:</span></p><p><span style="background-color: rgb(255, 0, 255);">Clients and Employers:</span></p><p>Free unlimited Job Posting</p><p>No transaction fee for first 10 transactions and then only US$1.00 per transaction&nbsp;</p><p><br></p><p><span style="background-color: rgb(255, 0, 255);">Freelancers:</span></p><p>You pay only $ 0.50 per transaction to Softral, Plus you pay the&nbsp;<span style="line-height: 1.428571429; -webkit-text-size-adjust: 100%;">Money Transfer Fees only.&nbsp;</span><span style="line-height: 1.428571429; -webkit-text-size-adjust: 100%;">You can choose the money transfer method of your convenience</span></p><p>Payment by Check with no fee; Free by mail</p><p>Payment by Western Union: WU fee only. It can be $0.00 depending upon the destination address.</p><p>Skrill: Skrill fee only</p><p>Paypal: you pay the PayPal fee only</p>', '', '1', 0, 'plans-fees-1'),
(20, 'Plans & Fees', '<p><span style="font-weight: bold;">Standard Plan:</span></p><p><span style="background-color: rgb(255, 0, 255);">Clients and Employers:</span></p><p>Free unlimited Job Posting</p><p>No transaction Fees</p><p><br></p><p><span style="background-color: rgb(255, 0, 255);">Freelancers:</span></p><p>$1.00 per transaction to Softral</p><p>Money Transfer Fees only</p><p>You can choose the money transfer method of your convenience</p><p>Payment by Check Fee; Free</p><p>Payment by Western Union: WU fee only</p><p>Skrill: Skrill fee only</p>', '', '1', 19, 'plans-fees-2'),
